(19, 'ساعة سيكو5 اتوماتيك ذهبي صناعة يبانية', 'Seiko 5 automatic watch Japanese made si', '211', '1', '8978111', 'ujbhgbikbg11', '877111', '/tmp/phpdVI0CF', 71, 14, '', '', '911', '0', '11', '1', 'TRUE', '231', '2022-04-09 21:04:26', '2022-06-29 20:27:35', NULL, NULL, NULL, NULL, 1, 33),
(20, 'ساعة سيكو5 اتوماتيك ذهبي صناعة يبانية', 'Seiko 5 automatic gold watch Japanese ma', '550', NULL, NULL, 'ساعة سايكو اوتوماتيكية أصلية بلون ذهبي أنيق بخلفية راقية بها مؤشر للتاريخ واليوم', 'Original Seiko automatic watch in elegant gold color with a classy background with date and day indicator', '1640787334804ساعة سيكو5 اتوماتبك ذهبي صنع يباني سعر  550 ريال سعودي.jpg', 6, 14, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:17', NULL, NULL, NULL, NULL, 143, 33),
(21, 'ساعة سيكو5 اتوماتيك صنع يباني فضي وذهبي', 'Seiko 5 automatic watch Japanese made si', '550', NULL, NULL, 'ساعة سايكو أصلية صناعة يابانية خليط بين اللون الفضي والذهبي بها مؤشر لليوم والتاريخ بخلفية هادئة', 'An original Seiko watch made in Japan, a combination of silver and gold, with a day and date indicator on a soft background', '1640787080518ساعة سيكو5 اتوماتبك صنع يباني سعر  550 ريال سعودي.jpg', 6, 14, '', '', 'ساعة', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:17', NULL, NULL, NULL, NULL, 144, 33),
(22, 'ساعة سيكو5 اتوماتيك  فضي كامل صنع يباني', 'Seiko 5 automatic silver watch made in J', '550', NULL, NULL, 'ساعة سايكو يابانية الصنع بها مؤشر للتاريخ واليوم خلفية بخطوط هندسية دقيقة', 'Japanese-made Seiko watch with date and day indication with delicate geometric lines', '1640787173284ساعة سيكو5 اتوماتبك  فضي كامل صنع يباني سعر  550 ريال سعودي 1.jpg', 6, 14, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:17', NULL, NULL, NULL, NULL, 145, 33),
(23, 'ساعة سيكو5 اتوماتيك فضي كنوكراف ياباني', 'Seiko 5 Automatic Knograv Japanese Silve', '550', NULL, NULL, 'ساعة سايكو 5 الشهيرة تناسب الزي الرسمي والكاجول بتصميم ملفت متعددة المقاييس والمؤشرات بها تاريخ وثلاثة أزرار تحكم معالجة ضد الصدأ', 'The famous Seiko 5 watch with an attractive design, multi-scales and indices, with a date and three control buttons treated against rust', '16407871350685.2ساعة سيكو5 اتوماتبك فضي كنوكراف صنع يباني سعر  550 ريال سعودي.jpg', 6, 14, '', '', 'ساعة', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:17', NULL, NULL, NULL, NULL, 146, 33),
(24, 'ساعة سيكو5 اتوماتيك فضي الثلج صنع يباني', 'Seiko 5 automatic watch Ice Silver Made', '550', NULL, NULL, 'ساعة سايكو 5 اوتوماتيك يابانية الصنع بها مؤشر للتاريخ واليوم بالعربي الخلفية لون ثلجي بخطوط هندسية دقيقة', 'Seiko watch 5 automatic Japanese made with date and day indicator in Arabic, background is snowy color with precise geometric lines', '1640787038767ساعة سيكو5 اتوماتبك  فضي كامل صنع يباني سعر  550 ريال سعودي.jpg', 6, 14, '', '', 'ساعة', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:17', NULL, NULL, NULL, NULL, 147, 33),
(25, 'ساعة سيكو5 اتوماتيك ذهبي مع فضي صنع يبان', 'Seiko 5 automatic gold and silver watch', '650', NULL, NULL, 'ساعة سايكو 5 الفخمة بلون فضي مزينة بالذهبي عقارب ومؤشرات داخلية مزخرفة باللون الذهبي بها مؤشر للتاريخ واليوم', 'Seiko 5 luxury watch in silver tone with gold-tone hands and indexes, decorated with gold-tone interior, with date and day indications', '1640786984974ساعة سيكو5 اتوماتبك ذهبي مع فضي صنع يباني سعر  650 ريال سعودي.jpg', 6, 14, '', '', 'ساعة', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:17', NULL, NULL, NULL, NULL, 148, 33),
