(78, 'كريم تفتيح البشرة من ريا', 'Rea whitening beauty cream', '15', NULL, NULL, 'كريم تجميل يبيض لون البشرة ويجعلها ناصعة و رطبة يحتوي على عناصر فعالة تساعد على التخلص من الحبوب و البثور السوداء و البقع والنمش و يحمي البشرة ضد الالتهابات', 'A cosmetic cream that whitens the skin color and makes it bright and moist. It contains active ingredients that help to get rid of pimples, black pimples, spots and freckles, and protects the skin against infections.', '1641801170544WhatsApp Image 2022-01-09 at 13.04.23.jpeg', 1, 22, 'without alcohol', '', '50g', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 204, 41),
(79, 'صابون وايت سيكريت', 'white secret soap', '20', NULL, NULL, 'يحتوي صابون وايت سيكريت لتفتيح الجسم والوجه على أصول طبيعية أثبتت فعاليتها في التنوير للتنظيف العميق الذي يترك البشرة ناعمة ومنتعشة طوال اليوم.', 'White Secret Lightening Soap For Body And Face Contains Natural Assets Proven To Enlighten For A Deeply Cleaning Which Leaves The Skin Smooth And Fresh All Day.', '1641801585253WhatsApp Image 2022-01-09 at 13.04.23 (1).jpeg', 1, 22, 'without alcohol', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 205, 41),
