(148, 'رذاذ مرطب ومعطر للوجه والجسم مسك', 'Moisturizing and perfumed mist for face', '49.99', NULL, NULL, 'رذاذ مرطب ومنعش للبشرة بتركيبة أساسها عشبة كاميميليس فيرجينيانا الويتش هازل. فوائده:  - يلطف ويرطب البشرة. - يقي بشرتك من أشعة الشمس والعوامل البيئية الضارة. - مثالي بعد الحلاقة. - التحكم بالتعرق المفرط (يعتبر الويتش هازل مزيل عرق طبيعي). - نسمة من الإنتعاش والنقاء.', 'Its benefits:  - Soothes and moisturizes the skin. Protects your skin from sunlight and harmful environmental factors. Perfect after shaving. Control excessive sweating (witch hazel is a natural deodorant). A breath of freshness and purity.', '1642069602199WhatsApp Image 2022-01-13 at 13.08.27.jpeg', 1, 20, '', '', '150ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 275, 39),
