(150, 'رذاذ مرطب ومعطر للوجه والجسم، لوتس', 'Moisturizing and fragrant face and body', '49.99', NULL, NULL, 'رذاذ مرطب ومنعش للبشرة بتركيبة أساسها عشبة كاميميليس فيرجينيانا الويتش هازل. فوائده:  - يلطف ويرطب البشرة. - يقي بشرتك من أشعة الشمس والعوامل البيئية الضارة. - مثالي بعد الحلاقة. - التحكم بالتعرق المفرط (يعتبر الويتش هازل مزيل عرق طبيعي). - نسمة من الإنتعاش والنقاء.', 'Moisturizing and refreshing mist for the skin with a formula based on the herb Camemillis virginiana Witch Hazel. Its benefits:  - Soothes and moisturizes the skin. Protects your skin from sunlight and harmful environmental factors. Perfect after shaving. Control excessive sweating (witch hazel is a natural deodorant). A breath of freshness and purity.', '1642069703527WhatsApp Image 2022-01-13 at 13.11.24.jpeg', 1, 20, 'Ingredients: Purified Water, Witch Hazel Extract, Glycerin, Lotus Flower Extract, Aloe Vera Extract, Hydrogenated Castor Oil, Propylene Glycol, Phenoxyethanol, Niacinamide.', '', '150ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 277, 39),
