(152, 'سيباميد، لوشن واقي من أشعة الشمس متعددا', 'Sebamed, Multi Protect Sun Lotion', '38.99', NULL, NULL, 'لوشن سيباميد هو نظام فعال للغاية في فلترة الأشعة فوق البنفسجية بنوعيها UVA/UVB يعمل إلى جانب أصباغ دقيقة تمنع التلف الناتج عن أشعة الشمس والتهيج في البشرة. كما يقدم حماية من التقدم في السن للبشرة مع فيتامين E وبروفيتامين تجديد البشرة B5.', 'Sebamed Lotion is highly effective UVA/UVB filter system combined with micro-pigments prevent sunlight-induced damage and irritations to the skin. It also provides Anti-Ageing skin protection with vitamin E and regenerating provitamin B5.', '1642073205821WhatsApp Image 2022-01-13 at 13.21.34.jpeg', 1, 20, 'Vitamin E and B5', '', '150ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 279, 39),
