(154, 'قطن جونسون الطبيعي لإزالة المكياج - 80 ق', 'Johnsons Pure Cotton Make-up Pads - 80', '13.5', NULL, NULL, 'قطن جونسون الطبيعي هو قطن نقي 100% لإزالة المكياج ويعتبر من أساسيات العناية بالبشرة ونظافتها. قطع القطن عالية الامتصاص سهلة الاستخدام ولا تترك بقايا ألياف قطن على بشرتك. قطن المكياج من جونسون مغلّف في عبوة صحية وقابلة لإعادة الاستخدام لتضمن لكي الأفضل لبشرتك.', 'These 100% cotton make up pads truly are a daily essential for your skin! JOHNSONS® Pure Cotton Make-up Pads are absorbent and easy to use, maintaining their shape without leaving cotton fibres on your skin. And they are packed in a reusable hygienic package. Make sure to be using only the best for your skin.', '1642074567668WhatsApp Image 2022-01-13 at 13.25.27.jpeg', 1, 20, 'Cotton', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 281, 39),
