(290, 'عطر ياقوت', 'Yaqout perfume', '280', '215', NULL, 'عطر خشبي زهري، رائحة راقية تجعلكِ تشعرين بالانتعاش مع مزيج مذهل من الحمضيات والياسمين والسرو.والمسك الخاص', 'A floral woody fragrance, a sophisticated scent that makes you feel fresh with an amazing blend of citruses, jasmine and cypress.and special musk', '1642934656826WhatsApp Image 2022-01-22 at 11.51.50.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 425, 34),
(291, 'عطر عشق المملكة', 'Eishq almamlaka perfume', '320', '246', NULL, 'للجنسين  رقيق يسير على وتر زهري ممزوج بلعود والعسل . تم اطلاق العطر  في عام 2019.   سمفونية عطرية مغرية تلهم الحواس وتبدأ أولى نغماتها بلمسات حارة مع الفلفل الوردي، النيرولي واوراق النخيل.   مررواً في قلب التكوين مع العسل ، والبرتقال ووردة فرانجيباني.   في حين تختتمها قاعدة التكوين لتستقر برفقة العود وخشب الصندل', 'Unisex, gentle, walking on a floral chord mixed with oud and honey. The fragrance was launched in 2019. A seductive aromatic symphony that inspires the senses and opens its first notes with spicy notes with pink pepper, neroli and palm leaf. Swirl in the heart of the composition with honey, orange and rose frangipani. While the composition base concludes to settle with agarwood and sandalwood', '1642934715175WhatsApp Image 2022-01-22 at 11.52.29.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 426, 34),
(292, 'عطر القيصر', 'Al Kaiser perfume', '345', '265', NULL, 'عطر قويّ وجذّاب بعبق الدّخان والتّوابل الموجودة في طبقته الوسطى. يبدأ بنغمات داكنة فور ملامسته البشرة، ثمّ تظهر طبقات عذبة برائحة الإجاص الأبيض والتّفاح الأخضر والعود والياسمين والفتيفر والفانيليا. عطرحلو ولذيذ، مناسب لكلّ الشخصيّات', 'A strong and attractive fragrance with the smell of smoke and spices in its middle layer. It starts with dark tones upon contact with the skin, then reveals fresh layers with the scent of white pear, green apple, oud, jasmine, vetiver and vanilla. A sweet and delicious fragrance, suitable for all personalities, a strong and attractive fragrance with the smell of smoke and spices in its middle layer. It starts with dark tones upon contact with the skin, then reveals fresh layers with the scent of', '1642935020459WhatsApp Image 2022-01-22 at 11.53.12.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 427, 34),
(293, 'عطر إحساسي', 'Ehsasi', '270', '207', NULL, 'عطر شرقي - زهري للجنسين.  إفتتاحية العطر الزعفران و الياسمين; قلب العطر خشب العنبر و الآمبرغريس; قاعدة العطر تتكون من أصماغ التنوب و خشب الأرز.', 'An oriental floral fragrance for unisex. Top notes are saffron and jasmine; middle notes are amber wood and ambergris; base notes are fir resin and cedar wood.', '1642935250027WhatsApp Image 2022-01-22 at 11.54.02.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 428, 34),
(294, 'عطر الخليجيه', 'Alkhalegiah perfume', '235', '180', NULL, 'يضيء هذا العطر بابتسامة مفعمة بالحيوية بعبق الياسمين و الأزهار والفاكهة الحمضية، وتداعب نفحاته الخشبية الناعمة الحواس إلى جانب رائحة المسك الهادئة.', 'This perfume illuminates a lively smile with the scent of jasmine, floral and citrus fruits, and its soft woody notes tantalize the senses, along with the calming scent of musk.', '1642935526490WhatsApp Image 2022-01-22 at 11.54.53.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 429, 34),
(295, 'العطر الملكي', 'Royal perfume', '345', '265', NULL, 'العطر  يكشف الجلد الزهري والتوابل الرائعة من خواطر الخليج  عن رائحة لا مثيل لها للرجال والنساء. الحرية تأتي من الداخل. قلب الصحراء الغربي و الجلد', 'The fragrance reveals the floral leather', '1642935727145WhatsApp Image 2022-01-22 at 11.55.50.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 430, 34),
(296, 'عطر خيال', 'Khaial perfume', '280', '215', NULL, 'تحتضن المكونات المنعشة للحمضيات واليانسون النجمي الضوء قبل أن تذوب في مزيج حسي عميق وغورماند خشبي من الباتشولي والكاكاو.', 'Fresh notes of citrus and star anise embrace the light before melting into a deep, sensual blend and woody gourmand of patchouli and cocoa.', '1642935886309WhatsApp Image 2022-01-22 at 11.56.27.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 431, 34),
(297, 'عطر الجاذبية', 'Aljathebiah perfume', '285', '219', NULL, 'تحتوي المكونات العليا لعطر الجاذبيه من خواطر الخليج على اللافندر والليمون الأمفالي. إن حلاوة الأزهار والنكهة الحمضية من الليمون تجعل تركيبة العطر ساحرة بشكل لا يصدق.', 'The top notes of this Al Jazbia perfume from Khawatier Al Khaleej contain lavender and amvali lemon. The floral sweetness and citrusy flavor of lemon make the composition of the fragrance incredibly charming.', '1642936088093WhatsApp Image 2022-01-22 at 11.57.24.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 432, 34),
(298, 'عود الخواطر', 'Oud alkhawater', '375', '288', NULL, 'رونق وثبات وسحر يدوم لخلطة ثمينة من دهن العود الهندي نادر الوجود، مستخرج من أشجار معمرة في غابات الهند، يُثري الروح بعبق من غابر الزمان وقدم المكان.', 'The luster, stability and lasting charm of a precious mixture of rare Indian oud oil, extracted from perennial trees in the forests of India, enriches the soul with a fragrance from the ancient times and the ancient place.', '1642936261886WhatsApp Image 2022-01-22 at 11.58.28.jpeg', 5, 15, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:19', NULL, NULL, NULL, NULL, 433, 34),
(299, 'مسك الكاندي', 'Candy mesk', '115', NULL, NULL, 'تمتع بإطلالة خاصة ومثيرة مع توليفة العطر الفاخرة والمثيرة من المسك والعنبر.  العطر معزز بروائح الورود والياسمين مع نكهات لذيذة من الكراميل تزيد من جمال الرائحة وتمنحك انتعاشة خاصة', 'Enjoy a special and sensual look with the luxurious and sensual fragrance combination of musk and amber. The fragrance is enhanced by the scents of roses and jasmine with delicious flavors of caramel that increase the beauty of the smell and give you a special freshness', '1642936441006WhatsApp Image 2022-01-22 at 12.04.18.jpeg', 5, 15, '', '', '50ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 434, 34),
