(301, 'عطر مسك البودر', 'Mesk powder parfum', '115', NULL, NULL, 'تصميم عطري أنيق وجذاب من رذاذ المسك الساحر مع نعومة الفانيليا والبودرة الرقيقة.  العطر يبدأ بانتعاشة الياسمين والإيلنغ التي تضيف لمظهرك لمسات جمال وأناقة فاخرة وتلامس روحك برقة.  الرائحة مصممة للرجال والنساء معاً وتلائم كل المناسبات الخاصة والأمسيات والسهرات الصاخبة.', 'An elegant and seductive aromatic design of a musk mist with the softness of vanilla and delicate powder. The fragrance begins with the freshness of jasmine and ylang-ylang, which add to your appearance touches of luxury and elegance, and touch your soul gently. The scent is for both men and women and suits all special occasions, evenings and nights out.', '1642936827795WhatsApp Image 2022-01-22 at 12.05.30.jpeg', 5, 15, '', '', '50ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 436, 34),
(302, 'عطر مسك الخاص', 'Mesk special perfume', '115', NULL, NULL, 'تجربة عطرية جديدة ومميزة من قطرات المسك الساحرة مع نفحات من الجلود والزنبق والتونكا.  العطر يضيف لمظهرك لمسات كلاسيكية فاخرة وأنيقة تبهر عيون كل الحاضرين فور إطلالتك الأولى وتبقى مكثفة.  الرائحة تلائم الرجال والنساء وترافقك في المناسبات الرسمية والحفلات الخاصة لتبدو متفوقاً على الجميع بمظهرك الفاخر.', 'A new and distinctive aromatic experience of enchanting musk drops with notes of leather, lily and tonka bean. The fragrance adds to your look classic, luxurious and elegant touches that dazzle the eyes of all those present upon your first appearance and remain intense. The scent suits men and women and accompanies you in formal occasions and private parties to look superior to everyone with your luxurious look.', '1642936972081WhatsApp Image 2022-01-22 at 12.05.56.jpeg', 5, 15, '', '', '50ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 437, 34),
