(471, 'عود مروكي سوبر طبيعي فاخر', 'Oud Morroki Super', '300', '280', NULL, 'المحبب لدى اهل الخليج عامه واهل السعودية خاصه ، واحد من أجود أنواع البخور الأسيوية وتعد اندونيسيا هى أشهر مصادر العود المروكي الرائع،  ويتميز برائحته الزكية الثابتة التي تدوم لفترات طويلة.', 'Popular with the people of the Gulf in general and the people of Saudi Arabia in particular, it is one of the finest types of Asian incense, and Indonesia is the most famous source of the wonderful Maroki oud.', '1643054074059WhatsApp Image 2022-01-18 at 09.51.35.jpeg', 5, 30, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:20', NULL, NULL, NULL, NULL, 606, 49),
