(473, 'عود مروكي بيور سوبر مرتفع', 'Aoud Maroci Pure Super High', '300', '280', NULL, 'العود المروكي المحسن يعد من أفضل أنواع البخور التي يبحث عنها الكثير بفضل ما يوفره من رائحة مميزة حيث انتشر العود المروكي في دول الخليج العربي على نطاق واسع و منشأه الأصلي هي دولة إندونيسيا حيث يتم استخراجه من الغابات بالطرق التقليدية و يتم تنظيفه و تحسين جودته بنسبة 95% كما يتميز باللون البني الذي يدل على مدى جودته فضلاً عن رائحته التي تستمر في المكان و له رائحة عطرة جذابة يستطيع الضيوف لحظة استقبالهم تمييزها بالإضافة إلى إمكانية تقديمة هدية فهو يعد من الهدايا القيمة المعروفة بمدى جودتها كما يصل', 'The improved Maroki oud is considered one of the best types of incense that many people search for thanks to its distinctive aroma. The Maroki oud has spread widely in the Arab Gulf countries, and its original origin is Indonesia, where it is extracted from forests by traditional methods, and it is cleaned and its quality improved by 95 percent. It is also characterized by the brown color, which indicates the extent of its quality, in addition to its smell that persists in the place and has an a', '1643055619017WhatsApp Image 2022-01-18 at 09.51.35 (3).jpeg', 5, 30, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:20', NULL, NULL, NULL, NULL, 609, 49),
