(490, 'المسك الملكي ربع تولة', 'Mesk royal 1/4 tola', '400', '350', NULL, 'إن الزيت الملكي الذي يميزك بوجودك بين الجميع ، مصنوع من أقدم الأشجار المعمرة ، فلا تحرم روحك من رفاهية هذا الزيت.', 'The royal oil that distinguishes you by your presence among all, is made of the oldest aged trees, so do not deprive your soul of the luxury of this oil.', '1643055793710WhatsApp Image 2022-01-18 at 09.51.41 (3).jpeg', 5, 30, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:20', NULL, NULL, NULL, NULL, 626, 49),
(491, 'بودر مسك الغزال 1غ', 'Deer musk powder 1g', '350', '250', NULL, 'عُرف المسك عند العرب قديماً بأنه يغدقُ المرء برائحة عطِرة تُريح القلب، و تَفطرُ الفؤاد, كما وَرد ذِكر كلمة المِسك في القرآن الكريم ، وأحاديث السُّنَّة النبويَّة ؛ حيث استُخدِم للدلالة على الطِّيب ، والحُسن لبروز رائحته ، ونفاذها كما أن المسك ذو رائحة ساطعة طيِّب الريح وبه تُضرَب الأمثال والمَحاسِن', 'Musk was known to the Arabs in the old days to endow a person with a fragrant scent that relaxes the heart and breaks the heart. Where it was used to denote the goodness and beauty due to the emergence of its aroma and its penetration, just as musk has a bright scent, good for the wind, and with which proverbs and beauties are struck.', '1643056325705WhatsApp Image 2022-01-18 at 09.51.42.jpeg', 5, 30, '', '', '1 g', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:04:26', '2022-04-10 09:04:20', NULL, NULL, NULL, NULL, 627, 49),
