(564, 'دهن عود كمبودي فاخر تولة', 'Cambodian Luxurious Dehn Oud', '600', '550', NULL, 'صُنعت مجموعة زيوت الكمبودية باستخدام رقائق العود المختارة يدويًا والتي تحظى باهتمام خاص جدًا. يأتي زيت العود المتوازن هذا مباشرة من غابات كوه كونغ الجبلية (كمبوديا) والتي تتميز بمكونات عليا حلوة شبيهة بالعسل ، ونوتة وسطى خشبية مليئة بالباكو المهدئة ونفحات سفلية من المسك.', 'The Cambodian range of oils are made using hand-selected agarwood chips that are given very special attention. This well-balanced agarwood oil comes straight from the mountain forests of Koh Kong (Cambodia) and features sweet, honey-like top notes, a woody middle note filled with soothing pacu and base notes of musk.', '1643189536695WhatsApp Image 2022-01-12 at 11.22.25 (2).jpeg', 5, 23, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 701, 42),
(565, 'دهن ورد طائفي', 'Sectarian rose fat', '550', '500', NULL, 'دهن الورد الطائفي هو منتج نادر طبيعي عضوي، ويعتبر من اغلى الزيوت العطرية في العالم ينتج تقريبا من 12 ألف حبة ورد تولة عطر واحدة فقط، نقدم لكم في متجر جونة طيب مجموعة حصرية من العطورات النادرة والمميزة، منها دهن الورد الطائفي الطبيعي بمقاييس ومواصفات عالية جداً .', 'Taif rose oil is a rare natural, organic product, and it is considered one of the most expensive essential oils in the world. It produces approximately 12 thousand roses, and only one perfume. .', '1643189763741WhatsApp Image 2022-01-12 at 11.22.26.jpeg', 5, 23, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 702, 42),
