(571, 'حياتي جيرل دمية 18 إنش ساندي فستان بفيون', 'Hayati Girl - Doll Sandy in Bow Dress -', '249', '199', NULL, 'قصة ساندي: إن شغفها هو القراءة. وهي فتاة مثابرة تعمل بجد، خجولة أحيانًا وتستخدم الكتابة كثيرًا للتعبير عن مشاعرها. تتميز بمظهر جديد مع بندانة جميلة لإكمال المظهر مع لمسة أنثوية جميلة.', 'Sandys story: Her passion is reading. She is a persistent, hard-working girl who is sometimes shy and uses writing a lot to express her feelings. She has a fresh look with pretty bandanas to complete the look with a sweetly feminine touch.', '1643537479566Capture poupe.PNG', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 708, 72),
(572, 'لعبة حياتي جيرل', 'Hayati Girl Jeedah Doll', '249', '199', NULL, 'تحب الموضة ولديها شخصية جريئة. مبدعة ونشيطة وصبورة، تكمل ما بدأت به على أكمل وجه. شخصيتها الجريئة تسبب لها بعض المشاكل مع من حولها في بعض الأحيان', 'She loves fashion and has a bold personality. Creative, energetic and patient, she completes what she started to the fullest. Her daring personality sometimes causes her problems with those around her', '1643537799895Capturejeed2.png', 8, 53, '18 inch doll 1 1 . coat 1 white sweater 1 . pants shoe number 1', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 709, 72),
(573, 'حياتي جيرل دمية ساندي 18 إنش', 'Hayati Girl - Doll', '249', '199', NULL, 'هذه الفتاة شغوفة بالقراءة وهي شخصية مجتهدة ومثابرة تكون خجولة أحياناً وتستخدم الكتابة للتعبير عن مشاعرها.', 'This girl is fond of reading and is a hardworking and persistent personality who is sometimes shy and uses writing to express her feelings.', '1643538282830Capture10.PNG', 8, 53, '18 inch doll, 1 dress, 1 hairbrush clip, 1 handbag, 1 pants and 1 shoes', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 710, 72),
(574, 'حياتي جيرل دمية 18 إنش صبا فستان مخطط', 'Hayati Girl Doll Siba Fancy Dress 18In', '249', '199', NULL, 'لن تنتهي المتعة أبدًا مع فستان Hayati Girl Siba Stripes. تأتي الدمية بحجم 18 بوصة. لها شعر طويل ناعم. تحب فتاتك الصغيرة تمشيط شعرها وإنشاء العديد من تسريحات الشعر. إنه يرتدي فستانًا مخططًا جميلًا مع حذاء أسود. يمكن لفتاتك الصغيرة أن تأخذ معها الدمية الجميلة لتلعب مع الأصدقاء. كانت تستمتع باللعب مع دميتها الصغيرة والقيام بالكثير من المغامرات والقصص.  سيبا فتاة مغامر تحب الذهاب إلى الأماكن واكتشاف العالم. إنها مبدعة وتحب كتابة القصص المثيرة.', 'The fun will never end with Hayati Girl Siba Stripes Dress. The doll comes at a size of 18 inches. It has soft long hair. Your little girl would love to comb its hair and create many hairstyles. It is dressed in a lovely striped dress with black shoes. Your little girl can take the lovely doll with her to play with friends. She would have fun playing with her little doll and doing lots of adventures and stories.', '1643538714645Capture8.PNG', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 711, 72),
(575, 'حياتي جيرل دمية 18 إنش صبا فستان مخطط', 'Hayati Girl Doll Sandy Weavy Dress 18 In', '249', '199', NULL, 'ساندي: شغفها القراءة. فتاة مثابرة ومجتهدة تكون خجولة أحيانًا وتستخدم الكتابة كثيرًا للتعبير عن مشاعرها. فستانها فستان بأناقة مطلقة. اسود و ابيض -', 'Sandy: her passion is reading. A persistent, hardworking girl who is shy sometimes and uses writing a lot to express her feelings. her dress is a dress with absolute elegance. Black and white -', '1643538960836Capture6.PNG', 8, 53, 'Saba Min Hayati Girl doll wears a striped dress It comes in a size of 18 inches. She has long and soft hair. She wears a striped dress with black shoes.', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:05:29', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 712, 72),
(576, 'حياتي غيرل - دمية سيبا مع قناع 18', 'Hayati Girl - Doll Siba With Mask 18', '249', '199', NULL, 'يمكن للأطفال تعلم وتطبيق قواعد السلامة بمساعدة Hayati Girl Fab Friends Siba with Mask Set. قصة سيبا: بلونها الأبيض وتلك الفراشات الزرقاء الغامقة التي تحلق حولها ، يمكنك أن تشعر بالسلام والهدوء ، وتتمنى أن تطير فوق السماء. فتاة مغامر تحب الذهاب الى الاماكن واكتشاف العالم. إنها مبدعة وتحب كتابة القصص المثيرة. إنها مستعدة للخروج من المنزل مرتدية قناع وجه مطابق.', 'Kids can learn and implement safety rules with the help of Hayati Girl Fab Friends Siba with Mask Set. Siba Story: With its white color and those dark blue butterflies flying around it, you can feel peace and calmness, and wish you could fly above the sky. An adventurous girl who likes to go places and discover the world. She is imaginative and likes to write exciting stories. She is ready to step out of the house with a matching face mask on.', '1643540090651Capturepap.PNG', 8, 53, '1 18 Doll 1pc 2 Dress 1pc 3 Mask 4 Pants 1pc 5Shoes 1 pair', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:07:57', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 713, 72),
(577, 'حياتي فتاة دمية سيبا F. فستان 18 بوصة', 'HAYATI GIRL DOLL SIBA F.DRESS 18IN', '249', '199', NULL, 'يبقي طفلك مشغولاً بساعات من اللعب الإبداعي ، ويشجع المهارات التخيلية تحفز الألوان النابضة بالحياة التطور البصري يتميز بتفاصيل فريدة لإضفاء مظهر ملفت للنظر', 'Keeps your little one busy with hours of creative play, encouraging imaginative skills Vibrant colors stimulate visual development Boasts unique details for a striking appeal', '1643537070031Capture80.PNG', 8, 53, '1 18 Doll 1pc 2 Dress 1pc 3 Pants 1pc 4 Shoes 1 pair', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:16:04', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 714, 72),
(578, 'دمية ساندي من حياتي جيرل', 'Hayati Girl Sandy Doll - 18', '249', '199', NULL, 'إضافة رائعة إلى ألعاب صغيرتكِ تتمثل في هذه الدمية الرائعة، تتميز بشكل جميل وتفاصيل متقنة لتعزز من مهاراتها التخيلية وتبقيها منشغلة بالمرح، ومصنوعة من خامات عالية الجودة.', 'This doll will be adored by your daughter. Dressed in a beautiful polka print blue dress, this doll Sandy looks adorable and sweet. Your little one can carry little Sandy around and even take her on fun adventures. Made from quality material, Sandy is one such doll, which will make any little girl happy.', '1643539010139Capture66.PNG', 8, 53, '1 18 Doll 1pc 2 Dress 1pc 3 Pants 1pc 4 Shoes 1 pair', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:18:32', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 716, 72),
(579, 'دمية جيدا من حياتي للبنات مقاس 18 انش', 'Hayati Girl - Doll Siba With Mask', '249', '199', NULL, 'عندما تراها تشعر وكأنك دخلت حديقة مليئة بالألوان ، وبإمكانك سماع أصوات العصافير. مع ورود حمراء مطلية على هذا الفستان الأبيض النقي ، يمكنك أن تشعر وكأن أحلامك تتحقق. بقناع جميل يجعلك تشعرين بالصحة.', 'When you see it, you feel like you entered a garden full of colors, and you can hear the birds singing. With Its red roses painted on this pure white dress, you can feel like your dreams come true. With a beautiful mask which makes you feel healthy.', '1643540855982WhatsApp Image 2022-01-29 at 19.57.56.jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:18:32', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 717, 72),
