(608, 'كرسي الطعام للأطفال', 'Highchair with safety belt and tray', '230', '150', NULL, 'مقعد مرتفع يساعد طفلك على تطوير عاداتهم الغذائية والمهارات الاجتماعية. سهل الحمل والتفكيك مصنوع من البلاستيك والستيل', 'A highchair that helps your child develop their eating habits and social skills. Easy to carry and disassemble Made of plastic and steel', '1643540223903WhatsApp Image 2022-01-29 at 20.08.11.jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 746, 72),
(609, 'عربة اطفال سهلة الطي بيد واحدة', 'Easy one-hand folding baby stroller', '240', '165', NULL, 'يمكن طيها بسهولة بيد واحدة فقط - مثالية للتخزين في الأماكن الصغيرة أو القوارب الصغيرة مزودة بمسند ظهر كبير ومسند قدم قابل للتعديل ومظلة شمسية مسند الظهر: وضع واحد مع مرتبة', 'Easily folds up with just one hand - perfect for storage in small spaces or small boats Equipped with a large backrest, adjustable footrest and sun canopy Backrest: Single mode with mattress', '1643540505311WhatsApp Image 2022-01-29 at 20.09.26.jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 747, 72),
