(611, 'كرسي الأطفال', 'Baby  chair', '220', '150', NULL, 'يمكنك ضبط موضع مسند ظهر الكرسي وفقًا لمزاج طفلك راحة الصغار - بفضل المواد الناعمة والممتعة الملمس المستخدمة في البطانة والأحزمة ، يمكنك أن تطمئن إلى أن طفلك سيشعر دائمًا بالراحة والدلال', 'You can adjust the position of the backrest of the chair according to the mood of your child Little ones comfort - thanks to the soft and pleasant to touch materials used in the lining and straps, you can rest assured that your little one will always be comforted and pampered', '1643540882950WhatsApp Image 2022-01-29 at 20.10.58.jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:21', NULL, NULL, NULL, NULL, 749, 72),
