(614, 'صالة ألعاب رياضية وحفرة الكرة للأطفال', 'Activity Gym & Ball Pit', '189', '145', NULL, 'استكشف واحة صحراوية مليئة بالألعاب المرحة وكل ذلك في صالة واحدة للعب الأطفال', 'Explore a desert oasis full of fun games all in one childrens playroom', '1643541581624WhatsApp Image 2022-01-29 at 20.17.13.jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 752, 72),
(615, 'سكوتر انوار  وردي', 'Pink lights scooter', '179', '160', NULL, 'مصنوع من مكونات معدنية ونايلون متينة، بنفس الجودة مثل العلامات التجارية التي تكلف أكثر بكثير. مقبض على شكل حرف T مع 3 ارتفاعات قابلة للتعديل، تتميز المقابض أيضًا بوسادات قبضة مريحة. تصميم قابل للفك يجعل السكوتر مثاليًا للسفر أو التخزين.', 'Made with durable metal and nylon components, the same quality as the brands that cost a lot more. T-handle with 3 adjustable heights, the handles also feature comfortable grip pads. Detachable design makes the scooter ideal for travel or storage.', '1643541963625WhatsApp Image 2022-01-29 at 19.57.33 (1).jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 753, 72),
(616, 'ماسكرا لاش برينسس فالس لاش ايفكت من ايسن', 'Essence Lash Princess False Lash Effect', '40', '30', NULL, 'ماسكرا مذهلة تمنحك رموش أكبر حجمًا وأكثر كثافة بفضل تصميم الفرشاة المميزة وتركيبتها الفريدة.  صُممت فرشاتها بشعيرات كونيك فايبر لتصل إلى جميع رموشك من الجذور للأطراف وتغطيها بلون اسود جذاب وطبيعي.  بينما تركيبتها الرائعة تمنح رموشك تأثير الطول والكثافة والانحناء لتزيد من جاذبية عينيك.  مع هذه الماسكرا ستحصلين على رموش جذابة وعيون جميلة بتمريرة واحدة.', 'An amazing mascara that gives you bigger and fuller eyelashes thanks to the special brush design and unique formula. Its brush is designed with Konic-Fiber bristles to reach all your eyelashes from root to tip, coating them in an attractive, natural black color. While its wonderful formula gives your eyelashes the effect of length, volume and curve to increase the attractiveness of your eyes. With this mascara, you will get attractive eyelashes and beautiful eyes in one swipe.', '16436286160692222.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 754, 26),
(617, 'كريم اساس ميك اب كوفر من ديرماكول - 30غ', 'Dermacol Make up Cover', '45', '30', NULL, 'كريم أساس بتركيبة كريمية سائلة سهلة التطبيق والدمج على البشرة  يوفر لك تغطية احترافية تمكّنك من  تغطية جميع المناطق الداكنه وعيوب البشرة بدقّة، ويمنحك لمسة نهائية مطفية بدون لمعان.  اختيارك الافضل للحصول على مظهر بشرة متألقة.', 'Perfect makeup cover that will give you flawless skin looking.  Its creamy formula is soft and easy to apply, mix, and remove.  Provides perfect coverage that corrects and covers all dark spots and blemish with a matte finish.  The best foundation to have flawless makeup.', '1643629630402Capture.PNG', 1, 7, '', '', '30غ', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 755, 26),
(618, 'ماسكرا سكندلايز من ريميل لندن - اسود', 'Rimmel London ScandalEyes Mascara - Blac', '35', '25', NULL, 'ماسكرا سكندلايز من ريميل لندن، تمنحك رموش جذابة بلون أسود فاحم متألق.  غنيه بالكولاجين والكيراتين لتغذية رموشك، فرشاة الماسكرا ممتلئة بألياف ناعمة لتغطي كافة رموشك وتمنحها الكثافة.  اختيار مثالي لمظهر رموش جذابة وكثيفة.', 'Mascara created with a lightweight flexible formula to give you intense black color without clumping or smudging.  Easy to apply and with buildable volume to build your own intensity.  Enriched with collagen and keratin to moisturizes and nourishes your lashes.  Leaves you with flawless long lashes.', '1643629993502Capture99.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 756, 26),
(619, 'كريم اساس اير مات من برجوا', 'Bourjois Air Mat Foundation', '85', '70', NULL, 'تم تطوير كريم الأساس اير مات خصيصاً لإعطاء البشرة ملمس ناعم بدون لمعان ونضارة خالية من العيوب.  تحتوي تركيبة هذا الكريم على بودرة لتخفيف لمعان الوجه ولتحصلي على بشرة مطفية مشرقة.  كريم أساس اير مات من برجوا يمنحك تغطية كاملة للبشرة بدون شوائب تدوم لمدة 24 ساعة.  سيمنحك البشرة المثالية لتكملي مكياجك.', 'Bourjois Air Mat foundation has been specially developed to give skin a smooth, matte finish that lasts for up to 24 hours.  Its non drying, lightweight formula lets skin breathe throughout the day and provides high coverage for a flawless finish.  Enriched with mattifying micronized powders, it elimates shine with no mask effect for an undetectable result.  Starting at the centre of your face blend the formula outwards and upwards for a flawless finish whilst erasing any imperfections.', '1643626934387air.PNG', 1, 7, '', '', '30 ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 757, 26),
(620, 'ماسكرا سكندلايز ليكرا فلكس من ريميل لندن', 'Rimmel London ScandalEyes Lycra Flex Mas', '35', '25', NULL, 'احصلي على رموش كثيفة جدا واطلالة تدوم طويلا مع ماسكرا ليكرا  فلكس من ريميل لندن بلون اسود فاحم متألق وجذاب.  تمنحك رموش بحجم اكبر 10 مرات وتدوم لساعات طويلة بفضل تركيبتها المقاومة للماء والمضادة للسيلان.  فرشاة الماسكرا ممتلئة بالألياف الناعمة لتغطي كافة رموشك وتمنحها الكثافة .  اختيار رائع لرموش تزيد من جمال عينيك .', 'The Lycra Flex is designed to deliver dense and fluttery lashes that last all day long.  It gives you eyelashes 10 times larger and lasts for long hours.  Water-resistant and antiperspirant, and increases your look brilliantly.  It has an incredibly clump-free formula that coats the lashes to make them voluminous and long.  A great choice for a great eyelash.', '1643627341570sca.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 758, 26),
(621, 'رموش 3D من الحرير', '3D Silk Collection - Lash Lift', '20', '10', NULL, 'مجموعة رموش من الحرير لتعطي مظهر رموش طبيعية. لا تحتوي على صمغ.', 'A collection of silk lashes that mimic the look of natural hairs. Glue is not included in the pack', '1643627542214WhatsApp Image 2022-01-31 at 12.56.39.jpeg', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 759, 26),
(622, 'كريم اساس فيت مي مات اند بورليس من ميبلي', 'Maybelline Fit Me Matte And Poreless Fou', '80', '60', NULL, 'تمتعي بإطلالة متألقة بكريم اساس ميبلين الذي يعمل على توحيد لون البشرة بتغطية مثالية.  بقوام كريمي مطفي يمنحك مظهر متألق يدوم طويلاً.  يحتوي على تقنية بيرلايت المعدنية التي تمتص الزيوت لمنحك بشرة بدون لمعة.  مناسب للبشرة العادية والدهنية.  إختيار متألق لمظهر رائع بلا عيوب.', 'Smooth and perfect the look of your complexion with Maybelline Fit Me.  Matte and Poreless Foundation, a refining liquid foundation with a natural, matt finish.  Ideal for normal to oily skin types, the makeup is infused with micro-powders to help control shine and blur pores.  it glides effortlessly across skin, blending seamlessly to visibly minimize the appearance of pores and imperfections.  Suitable for normal to oily skin.  A radiant choice for a flawless look.', '1643628337672fou.PNG', 1, 7, '', '', '30ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 760, 26),
(623, 'ماسكرا اي لوف اكستريم كريزي فوليوم من اي', 'Essence I Love Extreme Crazy Volume Masc', '40', '30', NULL, 'عززي كثافة وطول رموشك بهذه الماسكرا الرائعة واجعلي عينيك أجمل.  تركيبتها المميزة خفيفة الوزن وقابله لزيادة طبقاتها بدون تكتل كي تمنح رموشك حجمًا أكبر وطولًا مثاليًا.  فرشاتها العملية مصممة لتصل لكل الشعيرات الطويلة والصغيرة حتى الرموش السفلية لتغطيها باللون الكثيف الجذاب.  هذه الماسكرا ستمنحك مظهر عيون جميلة برموش رائعة وخالية من العيوب.', 'Get thicker and bigger lashes with this special mascara.  With its buildable, smudge-proof formula, it delivers the best volume and length that lasts all day long.  The brush design was created to reach every single lash and spread its deep color for a great look, even in your lower lashes.  This great mascara will give you attractive eyes.', '1643629705031esse.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:19:03', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 761, 26);
