(665, 'سكوتر انوار  وردي', 'Pink lights scooter', '179', '160', NULL, 'مصنوع من مكونات معدنية ونايلون متينة، بنفس الجودة مثل العلامات التجارية التي تكلف أكثر بكثير. مقبض على شكل حرف T مع 3 ارتفاعات قابلة للتعديل، تتميز المقابض أيضًا بوسادات قبضة مريحة. تصميم قابل للفك يجعل السكوتر مثاليًا للسفر أو التخزين.', 'Made with durable metal and nylon components, the same quality as the brands that cost a lot more. T-handle with 3 adjustable heights, the handles also feature comfortable grip pads. Detachable design makes the scooter ideal for travel or storage.', '1643541963625WhatsApp Image 2022-01-29 at 19.57.33 (1).jpeg', 8, 53, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 753, 72),
(666, 'ماسكرا لاش برينسس فالس لاش ايفكت من ايسن', 'Essence Lash Princess False Lash Effect', '40', '30', NULL, 'ماسكرا مذهلة تمنحك رموش أكبر حجمًا وأكثر كثافة بفضل تصميم الفرشاة المميزة وتركيبتها الفريدة.  صُممت فرشاتها بشعيرات كونيك فايبر لتصل إلى جميع رموشك من الجذور للأطراف وتغطيها بلون اسود جذاب وطبيعي.  بينما تركيبتها الرائعة تمنح رموشك تأثير الطول والكثافة والانحناء لتزيد من جاذبية عينيك.  مع هذه الماسكرا ستحصلين على رموش جذابة وعيون جميلة بتمريرة واحدة.', 'An amazing mascara that gives you bigger and fuller eyelashes thanks to the special brush design and unique formula. Its brush is designed with Konic-Fiber bristles to reach all your eyelashes from root to tip, coating them in an attractive, natural black color. While its wonderful formula gives your eyelashes the effect of length, volume and curve to increase the attractiveness of your eyes. With this mascara, you will get attractive eyelashes and beautiful eyes in one swipe.', '16436286160692222.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 754, 26),
(667, 'كريم اساس ميك اب كوفر من ديرماكول - 30غ', 'Dermacol Make up Cover', '45', '30', NULL, 'كريم أساس بتركيبة كريمية سائلة سهلة التطبيق والدمج على البشرة  يوفر لك تغطية احترافية تمكّنك من  تغطية جميع المناطق الداكنه وعيوب البشرة بدقّة، ويمنحك لمسة نهائية مطفية بدون لمعان.  اختيارك الافضل للحصول على مظهر بشرة متألقة.', 'Perfect makeup cover that will give you flawless skin looking.  Its creamy formula is soft and easy to apply, mix, and remove.  Provides perfect coverage that corrects and covers all dark spots and blemish with a matte finish.  The best foundation to have flawless makeup.', '1643629630402Capture.PNG', 1, 7, '', '', '30غ', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 755, 26),
(668, 'ماسكرا سكندلايز من ريميل لندن - اسود', 'Rimmel London ScandalEyes Mascara - Blac', '35', '25', NULL, 'ماسكرا سكندلايز من ريميل لندن، تمنحك رموش جذابة بلون أسود فاحم متألق.  غنيه بالكولاجين والكيراتين لتغذية رموشك، فرشاة الماسكرا ممتلئة بألياف ناعمة لتغطي كافة رموشك وتمنحها الكثافة.  اختيار مثالي لمظهر رموش جذابة وكثيفة.', 'Mascara created with a lightweight flexible formula to give you intense black color without clumping or smudging.  Easy to apply and with buildable volume to build your own intensity.  Enriched with collagen and keratin to moisturizes and nourishes your lashes.  Leaves you with flawless long lashes.', '1643629993502Capture99.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 756, 26),
(669, 'كريم اساس اير مات من برجوا', 'Bourjois Air Mat Foundation', '85', '70', NULL, 'تم تطوير كريم الأساس اير مات خصيصاً لإعطاء البشرة ملمس ناعم بدون لمعان ونضارة خالية من العيوب.  تحتوي تركيبة هذا الكريم على بودرة لتخفيف لمعان الوجه ولتحصلي على بشرة مطفية مشرقة.  كريم أساس اير مات من برجوا يمنحك تغطية كاملة للبشرة بدون شوائب تدوم لمدة 24 ساعة.  سيمنحك البشرة المثالية لتكملي مكياجك.', 'Bourjois Air Mat foundation has been specially developed to give skin a smooth, matte finish that lasts for up to 24 hours.  Its non drying, lightweight formula lets skin breathe throughout the day and provides high coverage for a flawless finish.  Enriched with mattifying micronized powders, it elimates shine with no mask effect for an undetectable result.  Starting at the centre of your face blend the formula outwards and upwards for a flawless finish whilst erasing any imperfections.', '1643626934387air.PNG', 1, 7, '', '', '30 ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 757, 26),
(670, 'ماسكرا سكندلايز ليكرا فلكس من ريميل لندن', 'Rimmel London ScandalEyes Lycra Flex Mas', '35', '25', NULL, 'احصلي على رموش كثيفة جدا واطلالة تدوم طويلا مع ماسكرا ليكرا  فلكس من ريميل لندن بلون اسود فاحم متألق وجذاب.  تمنحك رموش بحجم اكبر 10 مرات وتدوم لساعات طويلة بفضل تركيبتها المقاومة للماء والمضادة للسيلان.  فرشاة الماسكرا ممتلئة بالألياف الناعمة لتغطي كافة رموشك وتمنحها الكثافة .  اختيار رائع لرموش تزيد من جمال عينيك .', 'The Lycra Flex is designed to deliver dense and fluttery lashes that last all day long.  It gives you eyelashes 10 times larger and lasts for long hours.  Water-resistant and antiperspirant, and increases your look brilliantly.  It has an incredibly clump-free formula that coats the lashes to make them voluminous and long.  A great choice for a great eyelash.', '1643627341570sca.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 758, 26),
