(672, 'كريم اساس فيت مي مات اند بورليس من ميبلي', 'Maybelline Fit Me Matte And Poreless Fou', '80', '60', NULL, 'تمتعي بإطلالة متألقة بكريم اساس ميبلين الذي يعمل على توحيد لون البشرة بتغطية مثالية.  بقوام كريمي مطفي يمنحك مظهر متألق يدوم طويلاً.  يحتوي على تقنية بيرلايت المعدنية التي تمتص الزيوت لمنحك بشرة بدون لمعة.  مناسب للبشرة العادية والدهنية.  إختيار متألق لمظهر رائع بلا عيوب.', 'Smooth and perfect the look of your complexion with Maybelline Fit Me.  Matte and Poreless Foundation, a refining liquid foundation with a natural, matt finish.  Ideal for normal to oily skin types, the makeup is infused with micro-powders to help control shine and blur pores.  it glides effortlessly across skin, blending seamlessly to visibly minimize the appearance of pores and imperfections.  Suitable for normal to oily skin.  A radiant choice for a flawless look.', '1643628337672fou.PNG', 1, 7, '', '', '30ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 760, 26),
(673, 'ماسكرا اي لوف اكستريم كريزي فوليوم من اي', 'Essence I Love Extreme Crazy Volume Masc', '40', '30', NULL, 'عززي كثافة وطول رموشك بهذه الماسكرا الرائعة واجعلي عينيك أجمل.  تركيبتها المميزة خفيفة الوزن وقابله لزيادة طبقاتها بدون تكتل كي تمنح رموشك حجمًا أكبر وطولًا مثاليًا.  فرشاتها العملية مصممة لتصل لكل الشعيرات الطويلة والصغيرة حتى الرموش السفلية لتغطيها باللون الكثيف الجذاب.  هذه الماسكرا ستمنحك مظهر عيون جميلة برموش رائعة وخالية من العيوب.', 'Get thicker and bigger lashes with this special mascara.  With its buildable, smudge-proof formula, it delivers the best volume and length that lasts all day long.  The brush design was created to reach every single lash and spread its deep color for a great look, even in your lower lashes.  This great mascara will give you attractive eyes.', '1643629705031esse.PNG', 1, 7, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:20:13', '2022-04-10 09:04:22', NULL, NULL, NULL, NULL, 761, 26),
