(959, 'جوارب بحواف من الدانتيل أسود', 'Lace Trim Stockings Black', '30', '28', NULL, 'هذه الجوارب تدل على نفسها نسيج قابل للتمدد ، يسمح بمرور الهواء', 'These stockings make a statement for itself Stretchable, breathable fabric', '1644485252177WhatsApp Image 2022-02-09 at 17.03.31.jpeg', 3, 62, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:26:36', '2022-04-10 09:04:25', NULL, NULL, NULL, NULL, 1050, 81),
(960, 'جوارب السماح', 'Stockings Al samah', '38', '34', NULL, 'جوارب السماح من أفضل أنواع الجوارب المتميزة بتقانة صنعها وجودتها العالية، وهي شركة سورية أصيلة بامتياز، يدخل القماش الشفاف العالي الجودة بصناعة جوارب السماح ونجد منه أشكال والوان مختلفة، وخاصة الألوان الأساسية كاللحمي، والأسود، وتشمل جوارب السماح أيضاً الكولونات الفائقة الجودة، والمتألقة برسماتها البسيطة والمذهلة، في بازار ماركت تجد تشكيلة كبيرة من أفضل جوارب السماح.', 'Samah socks are among the best types of socks distinguished by their high technology and high quality. It is an authentic Syrian company with distinction. High-quality transparent fabric is used in the manufacture of al-Samah socks, and we find from it different shapes and colors, especially the basic colors such as flesh and black. Amazingly, in Bazaar Market you will find a large selection of the best Samah socks.', '1644485298535WhatsApp Image 2022-02-09 at 17.03.31.jpeg', 3, 62, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:26:36', '2022-04-10 09:04:25', NULL, NULL, NULL, NULL, 1051, 81),
(961, 'عطر ميس كيوت  فرنسي', 'French perfume Miss Cute', '80', '75', NULL, '', '', '1644485519489WhatsApp Image 2022-02-09 at 17.03.31 (1).jpeg', 5, 62, '', '', '90ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:26:36', '2022-04-10 09:04:25', NULL, NULL, NULL, NULL, 1052, 81),
(962, 'تشويس او دي بارفان للنساء', 'Choice Eau De Parfum For Women', '80', '75', NULL, 'عطر زهري فاكهي مع نفحات زهرية من البازلاء الحلوة والبرغموت.', 'A floral fruity fragrance with floral notes of sweet pea, bergamot.', '1644485837666WhatsApp Image 2022-02-09 at 17.03.32.jpeg', 5, 62, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:26:36', '2022-04-10 09:04:25', NULL, NULL, NULL, NULL, 1053, 81),
(963, 'عطر سايروس  او دي بارفان  للرجال', 'Paris Bleu Cyrus Writer Gold - Eau de Parfum for man', '180', '170', NULL, 'يفتتح هذا العطر الذي لا يقاوم بمجموعة من المكونات القوية التي تمزج بين خلاصة الليمون والشيح والهيل مع رائحة دافانا الساحرة. تتفتح على قلب زهري من أزهار البرتقال ، وتتطور نحو مسار رجولي وحسي يتألف من نجيل الهند الهايتي وفول التونكا وودي العنبر.', 'This irresistible fragrance opens with a flight of zesty notes blending Lemon Essence, Artemisia and Cardamom with the bewitching scent of Davana. It blossoms on a floral heart of Orange Blossoms, evolving towards a virile and sensual trail composed of Haitian Vetiver, Tonka Bean and Woody Amber.', '1644512907177Capture2.PNG', 5, 62, '', '', '100nl', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:26:36', '2022-04-10 09:04:25', NULL, NULL, NULL, NULL, 1054, 81),
(964, 'عطرسبيس تايم للرجال', 'Space time for men -paris bleu', '180', '170', NULL, 'عطر مع ازدواجية مكثفة: بداية من الانتعاش المنعش يمتزج بأثر حسي حارق. يبدأ عطر Space Time برائحة الليمون والليمون والزنجبيل والقرفة والهيل. يكشف عن قلب عطري وفاكهي من التفاح والزعتر مدفأ بمزيج غني من العنبر والأرز. تتكون القاعدة الحسية والرجولة من نفحات نجيل الهند والتبغ المغلفة بحلاوة المسك الأبيض والفانيليا.', 'A fragrance with intense duality: the beginning of a refreshing freshness blends with a burning sensuality. Space Time perfume opens with notes of lemon, lime, ginger, cinnamon and cardamom. It reveals an aromatic and fruity heart of apple and thyme warmed by a rich blend of amber and cedar. The sensual and masculine base consists of notes of vetiver and tobacco wrapped in the sweetness of white musk and vanilla.', '1644486819525Capture4.PNG', 5, 62, '', '', '90ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:26:36', '2022-04-10 09:04:25', NULL, NULL, NULL, NULL, 1055, 81),
