(1564, 'شامبو شمر لايت', 'Shimmer light shampoo', '90', '70', NULL, 'شامبو بتركيبة غنية بالبروتين تزيل اللون النحاسي من الشعر الأشقر والرمادي. يزيل اللون الأصفر أو البرتقالي في الشعر المصبوغ. يجدد وينعش خصل الهايلايت الباهته. يمكن استخدامه على الشعر الطبيعي أو المصبوغ. يترك الشعر لامعاً بدون ترك رواسب.', 'A shampoo with a rich protein formula that removes brassy color from blonde and gray hair. Removes yellow or orange color in dyed hair. Rejuvenates and revives dull highlights. It can be used on natural or dyed hair. Leaves hair shiny without residue.', '1646127891534WhatsApp Image 2022-02-28 at 11.19.46.jpeg', 1, 87, '', '', '430ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:29:04', '2022-04-10 09:04:31', NULL, NULL, NULL, NULL, 1755, 106),
