(1566, 'شامبو بوست ام جي هير', 'MJ hair boost shampoo', '90', '65', NULL, 'شامبو بوست تخلصي من درجات اللون الأصفر النحاسي الدافئة بين مواعيد الصالون وحافظي على اللون الأشقر أو الفضي النابض بالحياة مع شامبو بلوند بوست يضيف الشامبو صبغة للشعر تعمل على تحييدها مع منع اللون من التلاشي يحافظ على لون مشرق ولامع', 'BLOND BOOST SHAMPOO Ditch the warm copper-yellow tones between salon appointments and keep your blonde or silver color vibrant with Blond Boost Shampoo. The shampoo adds a pigment to the hair that neutralizes it while preventing the color from fading Maintains bright and lustrous color', '1646128532380WhatsApp Image 2022-02-28 at 11.19.47.jpeg', 1, 87, '', '', '500ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:29:04', '2022-04-10 09:04:31', NULL, NULL, NULL, NULL, 1757, 106),
