(1577, 'زيت عرق السوس', 'Natures Answer Licorice Root Fluid Extract', '90', '75', NULL, 'زيت العرق سوس منناتشرز انسرهو عبارة عن مستخلص مصنوع من 2000 ملجم من جذور العرقسوس لكل جرعة. تعتبر فوائد عرق السوس مهمة للجسم، إذ أن زيت العرقسوس يعمل على تعزيز المناعة وزيادة قوة الجسم في محاربة الأمراض. بالإضافة إلى أنه يعزز نظام الهضم ويخفف من أعراض أمراض الجهاز الهضمي.  من فوائد العرقسوس ايضاً أنه يعتبر مكمل غذائي عشبي، يعمل على التعزيز من انسجام طاقات الجسد، كما يساعد licorice root على إزالة السموم من الجسم.  يحتوي المنتج على مستخلص جذور عرق السوس وماء بالاضافة الى جلسرين نباتي.  طريقة استخد', 'Naturals Licorice Oil is an extract made with 2,000 mg of licorice root per serving. The benefits of licorice are important for the body, as licorice oil enhances immunity and increases the bodys strength in fighting diseases. In addition, it enhances the digestive system and relieves symptoms of gastrointestinal diseases.  Among the benefits of licorice is also that it is considered a herbal food supplement, which works to enhance the harmony of the energies of the body, and licorice root help', '1646136190840WhatsApp Image 2022-02-28 at 11.19.56 (1).jpeg', 1, 87, '', '', '30ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:29:04', '2022-04-10 09:04:31', NULL, NULL, NULL, NULL, 1769, 106),
