(1677, 'تريشوب زيت شعر ضد القشرة', 'TRICHUP Anti Dandruff Hair Oil', '15', '12', NULL, 'يعمل تدليك زيت الشعر على تزييت وترطيب فروة الرأس ، مما يساعد على منع التساقط من المفيد أن تحافظ على شعرك صحيًا ولامعًا ولامعًا طوال اليوم دلكي الزيت بلطف على فروة الرأس. لا تشطف الشعر على الفور', 'Hair oil massage lubricates and conditions the scalp, helping to prevent flakes It is helpful to keep your hair healthy, lustrous and shiny all day long Gently massage oil on the scalp. Do not rinse hair immediately', '1646233681514WhatsApp Image 2022-02-13 at 14.12.13 (1).jpeg', 1, 49, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:29:41', '2022-04-10 09:04:32', NULL, NULL, NULL, NULL, 1869, 68),
