(1749, 'ساعة رولكس', 'Rolex watch', '450', '350', NULL, 'حزام من ستيل مقاوم للصدأ املس وجه ساعة دائري مع نافذة لاظهار التاريخ وخصائص الكرونوغراف حركة عقارب ثلاثية ومؤشرات واضحة اجزاء متصلة بلون ذهبي وحافة مائلة مزودة بقفل كبس يطوى للاغلاق تأتي في علبة تحمل شعار الماركة', 'Smooth stainless steel strap Round watch face with a window to show the date and chronograph functions Triple hands movement and clear indices Connecting parts in gold color and beveled edge Equipped with a fold-over clasp Comes in a box with the brands logo', '1646647242835WhatsApp Image 2022-03-02 at 13.17.34.jpeg', 6, 98, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:29:41', '2022-04-10 09:04:32', NULL, NULL, NULL, NULL, 1941, 117),
