(1812, 'ماسكارا ليكرا فليكس لعيون ساحرة من ريميل لندن', 'Rimmel London Scandal Eyes Lycra Flex Mascara', '27', '25', NULL, 'احصلي على رموش كثيفة جدا واطلالة تدوم طويلا مع ماسكرا ليكرا  فلكس من ريميل لندن بلون اسود فاحم متألق وجذاب.  تمنحك رموش بحجم اكبر 10 مرات وتدوم لساعات طويلة بفضل تركيبتها المقاومة للماء والمضادة للسيلان.  فرشاة الماسكرا ممتلئة بالألياف الناعمة لتغطي كافة رموشك وتمنحها الكثافة .  اختيار رائع لرموش تزيد من جمال عينيك .', 'Get extra thick eyelashes and a long-lasting look with the lycra-flex mascara from Rimmel London in a sparkling and attractive black color.  It gives you eyelashes up to 10 times more volume and lasts for long hours thanks to its waterproof and anti-drooping formula.  The mascara brush is full of soft fibers to cover all your eyelashes and give them volume.  A great choice for eyelashes that increase the beauty of your eyes.', '1646682368238WhatsApp Image 2022-03-02 at 13.18.36 (2).jpeg', 1, 98, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:29:41', '2022-04-10 09:04:33', NULL, NULL, NULL, NULL, 2004, 117),
