(2061, 'معمول الدوسري درجة اولى', 'Maamoul Al-Dossary first class', '96', '70', NULL, 'العمول الدوسري الفاخر المناسب لجميع الاذواق، ولتعطي المنزل رائحه زكيه وثابته لمدة طويله يأتيكم المنتج بسعر منافس وكميه وافره وبسعر إقتصادي وجوده عاليه. تم صنع المنتج خصيصا ليناسب ذائقتكم. يحتوي الصندوق على علبه بلاستيكيه داخله حتى يحفظ المنتج من الجفاف ويحفاظ على ثباته وبطئ احتراقه.', 'The luxurious Al Dosari Amoul is suitable for all tastes, and to give the house a pleasant and stable smell for a long time. The product comes to you at a competitive price, an abundant quantity, an economical price and a high quality. The product is specially made to suit your taste. The box contains a plastic box inside to keep the product from drying out, maintain its stability and slow burning.', '1646906698656WhatsApp Image 2022-03-07 at 12.23.37.jpeg', 5, 114, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:33', NULL, NULL, NULL, NULL, 2054, 133),
