(2095, 'عود كلمنتان فاخر', 'Premium Kalimantan agarwood', '150', '75', NULL, 'خشب عود كلمنتان راقي جدا ومغمور برائحة فواحة ودخون كثيرة تنعش الأجواء بنسماتها الطيبة، يعتبر من الأبخرة المفضلة لفئة المجتمع الراقية والأكثر شهرة على الإطلاق يمكن استخدامه للتطيب خلال اليوم وقبيل الصلوات وفي أرجاء المنزل، لونه أسود داكن لإحتوائه على دهن كثيف جدا، مناسب جدا للإهداءات والمناسبات السعيدة والزواجات.  سمي بهذا الاسم نسبة إلي غابات كلمنتان التي تقع في شرق دوله اندونيسيا و يطلق علي هذا النوع عود كلمنتان أو عود مالينو، يتوفر بعدة أنواع ويصنف طبقا لدرجة الجودة.', 'Kalimantan oud wood is very refined and covered in a fragrant scent and many smokes that refresh the atmosphere with its good breezes. It is considered one of the favorite fumes of the high-end community and the most famous of all. It can be used for perfume during the day and before prayers and throughout the house, its dark black color because it contains a very thick fat, very suitable for gifts and occasions Happy marriages.', '1646924517746ggg.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2088, 135),
(2096, 'عود مروكي كينج سوبر  أوقية', 'Oud Morroki King Super', '176', '99', NULL, 'رائحة عطرة والعديد من الدخان الذي ينعش الجو بنسماته الجيدة. يعتبر من الأدخنة المفضلة للمجتمع الراقي والأكثر شهرة على الإطلاق. يمكن استخدامه للعطور أثناء النهار وقبل الصلاة وفي جميع أنحاء المنزل لونه الأسود الغامق لاحتوائه على دهون كثيفة جداً ومناسب جداً للهدايا والمناسبات الزيجات السعيدة.', 'refined and covered in a fragrant scent and many clouds of smoke that refresh the atmosphere with its good breezes. It is considered one of the favorite fumes of the high-end community and the most famous of all. It can be used for perfume during the day and before prayers and throughout the house, its dark black color because it contains a very thick fat, very suitable for gifts and occasions Happy marriages.', '1646924747921knn.PNG', 5, 116, '', '', '28g', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2089, 135),
