(2117, 'عود فراشه اشهب كبير أوقية', 'Big butterfly stick agarwood wuqia', '80', '40', NULL, 'عود الفراشة يعتبر من اشهر أنواع اعواد البخور الصناعي و بالرغم من كثرة أنواعه و جودته الا اننا حرصنا على توفير افضل الأنواع ذات الجودة و كمية الدهون العالية المشبع بها لتمنحك احساس بالفخامة و تجعل من رائحة المكان جميلة وزكية حيث يضيف لك راحة نفسية ويعطي لك مزيد من الايجابية', 'The butterfly oud is one of the most famous types of artificial incense sticks, and despite its many types and quality, we were keen to provide the best quality types and the high amount of saturated fats in them to give you a sense of luxury and make the place smell beautiful and sweet as it adds you psychological comfort and gives you more positivity', '1647122947454flr.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2110, 135),
(2118, 'عود SR صناعي رقم 1 أوقية', 'SR Industrial Oud No. 1 wuqia', '60', '45', NULL, 'عود إندونيسي فواح وجميل لإزالة الروائح الغير مرغوب بها من الجو أو تبخير المفروشات والأثاث.', 'A fragrant and beautiful Indonesian oud to remove unwanted odors from the air or fumigate furnishings and furniture.', '1647123180575sena.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2111, 135),
(2119, 'مسك الهيل', 'Musk Cardamom', '120', '48', NULL, 'رائحة عطرية جذابة وفواحة تبقى ملازمة لك لفترات طويلة يتمتع بثبات رائحته موضوع في عبوة زجاجية صغيرة يمكنك حملها بأي وقت، ومكان رائحته مزيج من الهيل المنعش ذو الرائحة اللذيذة المميزة يمتاز بالثبات والرائحة التي تدوم لفترات طويلة للغاية  تشعرين وكأنه مزيج عطري من روائح شرقية أصيلة  لا تترددي بطلب مسك الهيل المميز ذو الرائحة العطرية المختلفة', 'An attractive and fragrant aromatic scent that stays with you for long periods Enjoys its long-lasting aroma Contained in a small glass bottle that you can carry anytime, anywhere Its aroma is a mixture of refreshing cardamom with a distinctive delicious aroma It is long lasting and has a long lasting fragrance You feel like an aromatic blend of authentic oriental scents Do not hesitate to order the distinctive cardamom musk with a different aromatic scent', '1647123393898m.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2112, 135),
(2120, 'مسك الليل', 'Musk leyl', '120', '48', NULL, 'مسك الاحساس خليط برائحه المسك وروائحه حساسه جميله تشعرك بالراحه طوال اليوم رائحة عطرية جذابة وفواحة تبقى ملازمة لك لفترات طويلة يتمتع بثبات رائحته موضوع في عبوة زجاجية صغيرة يمكنك حملها بأي وقت', 'Sensational musk is a mixture of musk and its delicate and beautiful scents that make you feel comfortable throughout the day. An attractive aromatic scent that stays with you for long periods. Enjoys its long-lasting aroma Placed in a small glass bottle that you can carry at any time', '164712428122822330.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2113, 135),
(2121, 'مسك الاحساس', 'Musk al ahisas', '120', '48', NULL, 'خليط ساحر بين المسك وروائح ناعمه وبارده يمنحك عبير باردا ينعش أحاسيسك كلها جميله تشعرك بالراحه طوال اليوم رائحة عطرية جذابة وفواحة تبقى ملازمة لك لفترات طويلة يتمتع بثبات رائحته موضوع في عبوة زجاجية صغيرة يمكنك حملها بأي وقت', 'An enchanting mixture of musk and soft and cool scents that gives you a cool fragrance that refreshes all your senses, beautiful, makes you feel comfortable throughout the day, an attractive aromatic scent that stays with you for long Enjoys its long-lasting aroma Placed in a small glass bottle that you can carry at any time', '16471210136315231.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2114, 135),
(2122, 'مسك العود', 'musk agarwoodM', '120', '48', NULL, 'خليط ساحر بين المسك ورائحه العود يمنحك عبير شرقيا ينعش أحاسيسك كلها يمنحك عبير باردا ينعش أحاسيسك كلها جميله تشعرك بالراحه طوال اليوم رائحة عطرية جذابة وفواحة تبقى ملازمة لك لفترات طويلة يتمتع بثبات رائحته موضوع في عبوة زجاجية صغيرة يمكنك حملها بأي وقت', 'An enchanting mixture of musk and agarwood scent that gives you an oriental fragrance that refreshes all of your senses. Enjoys its long-lasting aroma Placed in a small glass bottle that you can carry at any time', '1647121137642oudmes.PNG', 5, 116, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-10 09:04:34', NULL, NULL, NULL, NULL, 2115, 135),
