(2213, 'كراون روزيز  لتصفيف الشعر', 'Crown Roses hair styling', '126', NULL, NULL, 'تصفيف الشعر من كراون روزيز يمكنك الحصول على شعر أنيق و حريري الملمس،   نمط جذاب ذو النمر الوردي الأنيق وبتصميم فريد و مرن يمكنك من الحصول على مظهر الشعر الطبيعي أو تموجات الشعر الدائمة دون الحاجة لإستخدام مثبتات الشعر أو غيرها من المنتجات.  كل ما تحتاجينه للحصول على تسريحة الشعر المناسبة كما لو انك في الصالون  ضمان الوكيل لمدة سنتين  صنع في الصين', 'Hair styling from Crown Roses, you can get elegant and silky hair,  Attractive style with elegant pink leopard and a unique and flexible design that enables you to achieve the appearance of natural hair or permanent hair waves without the need to use hairspray or other products.  Everything you need to get the right hairstyle as if you were in the salon  Agents warranty for two years made in China', '1647259337552WhatsApp Image 2022-03-10 at 15.14.01.jpeg', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2207, 113),
(2214, 'استشوار تصفيف الشعر من بولاند لورا 1200 وات فرشاة واحدة', 'Poland Laura Hair Styling Consultant 1200W 1 Brush', '115', NULL, NULL, 'نظام طاقة قوي 1200 واط يوفر لك الحرارة المناسبة وسرعة التسخين مما يوفر وقتك بصورة كبيرة. مقبض بطبقة مزدوجة لحماية يدك من الحرق مع فرشاة الهواء الساخن التي تدور دورة كاملة 360 درجة مما يجعل تصفيف الشعر أسهل. بقى الشعر خالياً من الضرر بتألق إضافي بعلاج من الأيونات السالبة وتكنولوجيا الحرارة بالأشعة تحت الحمراء', 'Powerful 1200W power system provides you with the right heat and fast heating, which greatly saves your time. Double layer handle to protect your hand from scalding with the hot air brush that rotates a full 360 degree rotation, making hair styling easier. Hair remains damage-free with extra shine with negative ion treatment and infrared heat technology', '1647259768091Capture.PNG', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2208, 113),
