(2221, 'استشوار تصفيف الشعر من بولاند لورا 1200 وات قطعتين فرش', 'Poland Laura Hair Styling Consultant 1200 Watts 2 Pieces Brushes', '115', NULL, NULL, '', '', '1647261426107Capture.PNG', 1, 94, 'Powerful 1200W power system provides you with the right heat and fast heating, which greatly saves your time. Double layer handle to protect your hand from scalding with the hot air brush that rotates a full 360 degree rotation, making hair styling easier. Hair remains damage-free with extra shine with negative ion treatment and infrared heat technology', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2216, 113),
(2222, 'مجفف الشعر من ادرا', 'Idra Hair Dryer', '126', NULL, NULL, '', '', '1647261938794WhatsApp Image 2022-03-10 at 15.14.05.jpeg', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2217, 113),
(2223, 'مصفف الشعر ومجفف الشعر من ريبون', 'REBUNE Hair Styler & Dryer', '172', NULL, NULL, 'يتميز المشط بتصميم بيضاوي لخلق كثافة من الجذور والحصول على أطراف مموجة جميلة – لا حاجة لاستخدام جهاز آخر للحصول على تموجات الشعر. وقت أقل، ضرر أقل! مصمم لتوزيع الهواء بسرعة وبالتساوي إلى الشعر لتجفيفه وتسريحه بشكل أسرع وبضرر أقل من الحرارة.  تكنولوجيا أيونية: تعمل الأيونات السالبة على تشبع الهواء لتقليل حجم قطرات الماء لتجفيف أسرع. يساعد في ترطيب وتمليس الشعر وجعله لامعاً أكثر مع تقليل التطاير والكهرباء الساكنة', 'The comb features an oval design to create volume from the roots and create beautiful curly ends - no other device needed to create waves. Less time, less damage! Designed to distribute air quickly and evenly to hair for faster drying and styling with less heat damage.  Ionic Technology: Negative ions saturate the air to reduce the size of water droplets for faster drying. Helps moisturize, smoothen hair and make hair more shiny while reducing frizz and static electricity', '1647262316309Capture.PNG', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2218, 113),
(2224, 'استشوار فرشة بالأيونات من ريبون 1300 واط RE-8888', 'Rebune hair dryer 1300 watts with ions RE-8888', '241', NULL, NULL, 'تقنية الأيونات السالبة التي تحمي الشعر من التقصف. الطاقة: 1300 واط /220-240 فولت /50-60 هرتز. إمكانية التحكم في السرعة والحرارة (off-cool-low-high). المشط غير قابل للفك. سلك قابل للدوران 360 درجة، وبطول 3 أمتار. حلقة لتعليق الجهاز. خفيف الوزن. مقبض كبير مريح للاستخدام. ضمان سنتين.', 'Negative ion technology protects hair from breakage. Power: 1300 watts / 220-240 volts / 50-60 Hz. Speed ​​and temperature control (off-cool-low-high). The comb is not detachable. 360-degree swivel cord, 3 meters long. loop for hanging the device. very lite. Large handle is comfortable to use. Two years warranty.', '1647259481689Capture.PNG', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2219, 113),
