(2226, 'ريبون مملس سيراميك موديل 484', 'Ceramic straightener model -484 | REBUNE', '126', NULL, NULL, 'يعتبر الشعر الأملس الناعم ريبون الرفيق المثالي للسيدات اللاتي يعشقن استعمال أدوات التصفيف للتعبير عن أنفسهن، بدون المخاطرة بصحة وحيوية شعورهن.', 'Smooth, silky hair is the perfect companion for women who love using styling tools to express themselves, without compromising the health and vitality of their hair.', '1647259909961Capture.PNG', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2221, 113),
(2227, 'ريبون مكواة فرد شعر سيراميك سوداء موديل 2023', 'REBUNE BLACK 2023 CERAMIC HAIR STRAIGHTENER MODEL', '242', NULL, NULL, 'تقدم لك ريبون  منتجات لفرد الشعر وتصفيفه لتجعل وقتك وجهدك أسهل مع تصميمات رائعة وميزات مثالية. تأتي هذه المكواة لتنعيم الشعر وتمنحه نعومة ولمعاناً في أقل وقت. يتميز بخفة وزنه بحيث يمكنك حمله معك في أي مكان وقدرته على فرد الشعر ومنعه من التطاير والتجعد ، سهل الاستخدام ويوفر عليك الوقت والجهد', 'Rebune offers you hair straightening and styling products to make your time and effort easier with great designs and perfect features. This iron comes to straighten hair and give it smoothness and shine in the least time. It is characterized by its light weight so that you can carry it with you anywhere and its ability to straighten hair and prevent it From volatilization and frizz, convenient to use and saves you time and effort', '1647260312335Capture.PNG', 1, 94, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:34:05', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2222, 113),
