(2322, 'استشوار شعر مع فرشتين من دافينا', 'Hair dryer with two brushes from Davena', '180', '120', NULL, 'استشوار شعر عملي يحتوي على فرشتين لتصفيف الشعر ومنحه كثافة ونعومة فائقة.  يحتوي على درجتين للحرارة وايضا على الهواء البارد ليمكنك من اختيار الدرجة المناسبة لشعرك.  مصمم بشعيرات فائقة النعومة والإنسيابية لحماية الشعر ومنحه لمعه فائقة.  اختيار مثالي لتحصلي على شعر ناعم وكثيف وجذاب.', 'A practical hair dryer that contains two brushes to style the hair and give it extreme density and softness.  It has two degrees of heat as well as cold air to enable you to choose the right degree for your hair.  Designed with ultra-soft and gliding bristles to protect and give hair a superior shine.  An ideal choice to get soft, thick and attractive hair.', '1647523951649WhatsApp Image 2022-03-16 at 10.44.35.jpeg', 9, 131, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2317, 150),
