(2324, 'جهاز تجعيد الشعر بمنفذ  يو س بي  وردي من دافينا', 'Pink USB Hair Curler Davena', '245', '190', NULL, 'مزود بشاشة عرض رقمية يعمل بالأشعة تحت الحمراء وفي اتجاهات مختلفة من أجل تجعيد وتمويج الشعر مزود بخاصية إيقاف التشغيل التلقائي بعد 30 دقيقة من الخمول لضمان السلامة الوقت اللازم للشحن بالكامل هو 40 دقيقة أقصى درجة حرارة هي 400 درجة فهرنهايت بينما الحد الأدنى هو 280 درجة فهرنهايت', 'Equipped with a digital display It works with infrared rays and in different directions for curling and curling hair Equipped with an automatic shutdown function after 30 minutes of inactivity to ensure safety The time required to fully charge is 40 minutes The maximum temperature is 400 degrees Fahrenheit while the minimum is 280 degrees Fahrenheit', '1647524773013WhatsApp Image 2022-03-16 at 10.44.36.jpeg', 9, 131, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2319, 150),
(2325, 'استشوار شعر مع فرشتين من دافينا', 'Davena Hair Styler with two Brushes', '165', '110', NULL, 'يوفر التصميم المرن حرارة مثالية لتقليل الضرر ومستوى تصفيف مثالي.  باستخدام هاتين الفرشتين ، يمكنك فرد الشعر أو إعطائه حجمًا أو تجفيفه بأي أسلوب تريده.  مصمم مع إعدادات الحرارة والسرعة بما في ذلك الإعداد البارد.  يترك الشعر لامعا وخال من التجعد.', 'The flexible design provides an optimal heat for less damage and a perfect styling level.  With these styling two brushes, you can straighten the hair, give it volume, or blow-dry it into any style you like.  Designed with heat and speed settings including a cool setting.   Leaves the hair frizz-free and shiny.', '1647525194490WhatsApp Image 2022-03-16 at 10.44.36 (1).jpeg', 9, 131, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2320, 150),
(2326, 'مجفف شعر من دافينا', 'Davena Hair Dryer', '178', '120', NULL, 'تصفيف خبير بعناية.  مرونة خفيفة الوزن ، قبضة مريحة ، عملية مريحة.  مجفف شعر للتجفيف والتصفيف الإبداعي يعمل على فرد جمال الشعر.  يوفر مستويين من تدفق الهواء لاختيار الأفضل لشعرك.  يضفي على الشعر مظهرًا حيويًا وصحيًا', 'Expert styling with care.  Lightweight flexibility, comfort grip, convenient operation.  Hair dryer for creative dry & style straightens hair beauty.  Provides 2 levels of air outflow to choose the best for your hair.  Leaves hair looking vibrant and healthy', '1647525898812WhatsApp Image 2022-03-16 at 10.44.36 (2).jpeg', 9, 131, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2321, 150),
(2327, 'سيراميك شعر بشاشة ديجيتال من دافينا', 'Davena Digital Hair Straightener', '197', '130', NULL, 'يوفر التصميم النحيف المبتكر حرارة متسقة ومتساوية لتسريح أسرع دون التسبب في نهايات مجعدة أو مجعدة.  مصمم بطلاء أملس وانزلاق مع التحكم في الحرارة المتغيرة لنقل الحرارة.  يتميز بشاشة عرض رقمية ، وتسخين فائق السرعة يصل إلى 750 درجة فهرنهايت.  أفضل خيار للحصول على تسريحة شعر ناعمة كالحرير.', 'The innovative thin design provides consistent and even heat for faster styling without causing creased or crimped ends.  Designed with smooth and glide coating with heat transfer variable heat control.  Features digital screen display, and super-fast heating up to 750F.  The best choice to have a silky smooth hairstyle.', '1647526045987WhatsApp Image 2022-03-16 at 10.44.37.jpeg', 9, 131, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2322, 150),
