(2414, 'بولغاري عطر أو برفيومي أو ذا نوار إنتينس او دو بيرفيوم للجنسين', 'Bvlgari Eau Parfumee Au The Noir Intense Unisex Perfume EDP', '570', '320', NULL, 'عطر أو برفيومي أو ذا نوار إنتينس او دو بيرفيوم من بولغاري  للرجال والنساء المحبين للرومانسية ويملكون روح حالمة إليكم هذا العطر الغني عبير الورود وزهور المانغوليا مغلفين بفخامة العود الأنيقة الذي يرضي تميزكم ويضيف إلى قلوبكم إحساس غاية في الرقة والنعومة يدوم معكم طوال اليوم.  مناسب لـ: الجنسين اسم المجموعة: أو برفيومي أو ذا نوار إنتينس النوتة العطرية: زهرية، خشبية نسبة التركيز: او دو بيرفيوم', 'The Au The Noir is an ode to the refined aroma of Chinese black tea. It tantalizing effects of this Bvlgari perfume are long-lasting and its suitable for evening or colder seasons wear.  Gender: Unisex Collection Name: Eau Parfumee au The Noir Intense Note Type: Floral, Woody Fragrance Type: EDP', '1648132765842WhatsApp Image 2022-03-20 at 15.25.20 (1).jpeg', 5, 124, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2409, 143);
