(2415, 'بولغاري عطر سبلينديدا روز او دو بارفان', 'BVLGARI Splendida Rose Rose Eau de Parfum', '635', '295', NULL, 'مع مجموعة سبلينديدا، تتسامى بولغاري بأغلى جوانب أحجار الطبيعة في صناعة العطور. سبلينديدا روز روز هو باقة ورد مغرية تستحضر الرومانسية الإيطالية الجوهرية بين بولغلري والمرأة الرائعة.', 'With the SPLENDIDA collection, BVLGARI sublimates the most precious facets of the Gems of Nature in Perfumery. SPLENDIDA BVLGARI ROSE ROSE is a seductive Rose bouquet evoking the quintessentially Italian romance between BVLGARI and fabulous women.', '1648133050279WhatsApp Image 2022-03-20 at 15.25.21.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2410, 143),
(2416, 'بولغاري - سبلينديدا ماغنوليا سينسول او دو بارفيوم', 'BVLGARI Splendida Magnolia Sensuel Eau de Parfum', '635', '295', NULL, 'من افضل العطور النسائية المثيرة بطابع زهري رومانسي تتميز برائحتها الفعالة وثباتها العالى التى تجعلك تشعر بالثقه وتاثر من حولك يقدم لكِ تجربة حسية فريدة لا تنسى، بفضل مكوناته المنعشة الممزوجة معًا بعناية ومهارة فائقة.', 'One of the best sexy womens perfumes with a romantic floral character characterized by its effective scent and high stability that makes you feel confident and influenced those around you. It offers you a unique and unforgettable sensory experience, thanks to its refreshing ingredients mixed together with great care and skill.', '1648133199466WhatsApp Image 2022-03-20 at 15.25.23.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2411, 143),
(2417, 'بولغاري مان جلسيال اسينس أو دو برفان', 'BVLGARI Man Glacial Essence Eau de Parfum', '560', '410', NULL, 'يُثري بولغري مان جلاسيال إيسنس مجموعة بولغري مان المخصصة لقوة العناصر الطبيعية. بعد الحريق والخشب ، يستكشف بولغري مان الهواء. يجسد بولغاري مان جلسيال اسينس الحجم الجامح للجبال المتجمدة والذكورة التي لا يمكن وقفها لرجل يسعى باستمرار إلى العظمة.', 'BVLGARI MAN GLACIAL ESSENCE enriches the Bvlgari Man collection dedicated to the power of natural elements. After fire and wood, Bvlgari Man explores Air. BVLGARI MAN GLACIAL ESSENCE captures the unbridled magnitude of the frozen mountains and the unstoppable masculinity of a man in constant quest for greatness.', '1648133366521WhatsApp Image 2022-03-20 at 15.25.23 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2412, 143),
(2418, 'بولغاري بولجاري مان للرجال او دى بارفان', 'Bvlgari Man Wood Essence Eau de Parfum', '560', '285', NULL, 'عطر رجالي مميز خشبي تم اصدارة 2019   مستوحى من الحياة البرية في الساحل الإيطالي.   تتكون تركيبته العطرية من البارغموت و زهرة البرتقال و براعم البرتقال و اخشاب الارز من فيرجينيا و رائحة الاخشاب و دهن العنبر و العنبر و المسك و الجلد   عطر  انيق مناسب للمناسبات الخاصة.', 'An elegant woody fragrance for Men that was released in 2019  Bvlgari Man Wood Neroli Eau De Parfum is inspired by the wilderness of coastal Italy.  With notes of bergamot , neroli , orange blossom , virginia cedar ,woody notes , ambergris , amber , musk and leather    The perfect scent for special occasions', '1648133515634WhatsApp Image 2022-03-20 at 15.25.24.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2413, 143),
(2419, 'بولغاري بيتتس ات ممز للنساء  - او دى تواليت', 'Bvlgari Petits Et Mamans for Women  Eau de Toilette Spray', '490', '295', NULL, 'عطر مبهج يتشارك به الأطفال وأمهم. يمنح دفئاً وانتعاشاً وحباً ومودة. يتميز بمكونات البابونج والطلبق الأصليين. يحتوي على البرغموت والبريتقال الصقلي. مثالي للاستعمال النهاري والاعتيادي.', 'A delightful fragrance that children and their mother share. It gives warmth, freshness, love and affection. Features the original chamomile and diary ingredients. Contains bergamot and Sicilian orange. Perfect for day and regular use.', '1648133894070WhatsApp Image 2022-03-20 at 15.25.25.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2414, 143),
(2420, 'اليزابيث اردن عطر فيفث افينو او دو بارفان', 'ELIZABETH ARDEN 5th Avenue Eau de Parfum', '550', '125', NULL, 'مستوحى من الهندسة المعمارية الكلاسيكية وافق مانهاتن المميز، تجسد اليزابيث اردن فيفث افينيو الاناقة الجذابة للشارع الاكثر شهرة في العالم. ينضح العطر بطاقة واثارة نيويورك مع الحفاظ على الانوثة الكلاسيكية والرفاهية.    روائح مقدمة العطر: مانغوليا ندية، ليلك، زهر ليندن، زنبق الوادي، ماندرين وبرغموت روائح قلب العطر: بنفسج، زهرة بلغارية نادرة، يلانغ يلانغ، ياسمين، مسك الروم الدرني، خوخ، قرنفل وجوزة الطيب روائح قاعدة العطر: عنبر، مسك تبتي، خشب صندل، سوسن وفانيليا', 'Inspired by the classic architecture of Manhattans signature style, Elizabeth Ardens Fifth Avenue embodies the quaint elegance of the worlds most famous street. The fragrance exudes the energy and excitement of New York while maintaining classic femininity and luxury.    Top notes: dewy mongolia, lilac, linden blossom, lily-of-the-valley, mandarin and bergamot Heart notes: violet, rare Bulgarian flower, ylang-ylang, jasmine, tuberose, peach, cloves and nutmeg Base notes: amber, tibetan musk,', '1648134095779WhatsApp Image 2022-03-20 at 15.25.25 (1).jpeg', 5, 124, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2415, 143),
(2421, 'عطر وايت دايموندز من اليزابيث تايلور للنساء - او دي تواليت', 'Elizabeth Taylor White Diamonds For Women  -Eau de Toilette', '380', '145', NULL, 'عطر نسائي مميز زهري تم اصدارة 1991.  تتكون تركيبته العطرية من  البارغموت و زهرة البرتقال و الزنبق و البنفسج و الورد و الياسمين و الإيلنغ و البتشولي و المسك و خشب الصندل والعنبر.  يمنحك رائحة عطرية خلابة تصعب مقاومتها.    عطر انيق مناسب لكل الأوقات.', 'A distinctive floral womens fragrance launched in 1991. Its aromatic composition consists of bergamot, orange flower, lily, violet, rose, jasmine, ylang-ylang, patchouli, musk, sandalwood and amber. It gives you a wonderful aromatic scent that is hard to resist. An elegant fragrance suitable for all times.', '1648134250109WhatsApp Image 2022-03-20 at 15.25.26.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2416, 143),
(2422, 'عطر بودي من بربري للنساء - او دو بارفيوم', 'Burberry Body For Women - Eau De Parfum', '385', '210', NULL, 'عطر نسائي مميز برائحة منعشة عطرية تم اصدارة 2011.  تتكون تركيبته العطرية من الخوخ و الفريزيا و الورد و السوسن و خشب الصندل و الكشمير و المسك و العنبر والفانيليا.  .هذا هو العطر الذي يمثل شخصيتك المميزة  عطر انيق مناسب لكل الأوقات.', 'An elegant aromatic fragrance for Women that was released in 2011.  Enriched with notes of  Peach, Freesia, Roses, Iris, Sandalwood, Cashmere, Musk, Amber, and Vanilla.  Your fragrance can be your identity.  The perfect scent for every occasion.', '1648134395658WhatsApp Image 2022-03-20 at 15.25.29.jpeg', 5, 124, '', '', '85ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2417, 143),
(2423, 'عطر بودي تندر او دي تواليت للنساء من بيربري', 'Burberry Body Tender Eau De Toilette for Women', '385', '210', NULL, 'A scent for the refined, the charismatic and the experienced is what this Body Tender womens EDT from Burberry is. Being an enticing evening perfume, its starts its choral enigma with lemon, apple and peach and then quietly invites hints of jasmine, sandalwood and rose. Its final notes arrive in the great gala of amber, musk and vanilla. Brand: Burberry', 'يبرز عطر النساء بودي تندر من بيربري هو عطر أناقتك وجاذبيتك، بحيث يلفت انتباه الجميع إليك فور دخولك إلى أي مكان. كونه عطر مسائي جذاب، فيبدأ سحره بالليمون والتفاح والخوخ، ثم يبعث لمحاتٍ من الياسمين وخشب الصندل والورد بكل هدوء. تصل مكوناته النهائية لتحدث صخبًا رائعًا من الكهرمان والمسك والفانيلا.', '1648134701368WhatsApp Image 2022-03-20 at 15.25.31.jpeg', 5, 124, '', '', '85ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2418, 143),
(2424, 'اسكادا سنتمنت  رجالي', 'ESCADA SENTIMENT POUR HOMME', '335', '185', NULL, 'عطر خشبي - أروماتك للرجال .  تم إصداره عام 2002. مقدمه العطر الزيزفون و توت العرعر; قلب العطر جوزه الطيب, و الفلفل الوردي; قاعدة العطر تتكون من خشب الصندل, نجيل الهند و أخشاب الأرز.', 'A woody-aromatic fragrance for men. It was launched in 2002. Top notes are lime and juniper berries; middle notes are nutmeg, pink pepper; base notes are sandalwood, vetiver and cedar.', '1648134831769WhatsApp Image 2022-03-20 at 15.25.32.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2419, 143),
(2425, 'بخاخ معطر للجسم أو دو برفيوم إسكادا للنساء', 'Escada Magnetism Eau De Parfum Natural Spray for Women', '375', '250', NULL, 'استمتع برائحة منعشة تدوم في جسمكِ مدة طويلة باختيار بخاخ المعطر الساحر هذا، يتكون من عطر فاخر غني برائحة جوز الهند والكاراميل مضاف عليهم قاعدة مسكية، ذو شكل أنيق بطابع أنثوي فريد، إختيار مناسب للإهداء.', 'This captivating and magnetizing fragrance evokes the power of attraction. It delights and attracts just like the woman who wears it. Flaunting base notes of coconut and caramel, this perfume comes inside a slightly curved bottle thats topped with a lid. Ideal for gifting, this perfume boasts a charming floral fragrance thatll make you feel oh-so-classy.', '1648135087625WhatsApp Image 2022-03-20 at 15.25.33.jpeg', 5, 124, '', '', '50ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2420, 143),
(2426, 'عطر اسكادا سبيشال من اسكادا للنساء - او دي بارفيوم', 'Escada Especially Escada For Women - Eau de Parfum', '295', '150', NULL, 'عطر برائحة الورد للنساء تم طرحه عام 2011.  يتكون من المسك الملوخية والكمثرى.  يؤدي إلى قلب الورد ونوتات الماء والإيلنغ.  القاعدة الدافئة لها المسك.  تشعر بتحسن عندما تكون رائحتك طيبة.  الرائحة المثالية لكل مناسبة', 'A freah, rosey fragrance made for women that was released in 2011.  Its composition includes musk mallow and pear.  Leads to the heart of rose, water notes and ylang ylang.  The warm base has musk.  You feel better when you smell good.  The perfect scent for every occasion', '1648135295283WhatsApp Image 2022-03-20 at 15.25.34.jpeg', 5, 124, '', '', '75ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2421, 143),
(2427, 'دانهيل لندن ايديشن للرجال  - او دى تواليت', 'Dunhill London Edition by Dunhill for Men Eau de Toilette', '340', '145', NULL, '', '', '1648135449538WhatsApp Image 2022-03-20 at 15.25.34 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2422, 143),
(2428, 'عطر او دو تواليت رجالي Custom من دنهل', 'Dunhill Custom Men Perfume EDT', '300', '125', NULL, '', '', '1648135641224WhatsApp Image 2022-03-20 at 15.25.34 (2).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2423, 143),
(2429, 'عطر ايكون ابسولوت من دنهل للرجال - أو دو برفيوم', 'Dunhill Icon Absolute For Men - Eau de parfum', '439', '210', NULL, 'عطر رجالي مميز عطري تم اصداره 2015.   تتكون تركيبته العطرية من الفلفل الأسود والبرغموت والزعفران والورد الأسود والياسمين والعود والجلود وأوراق التباكو.  يمنحك رائحة عطرية خلابة تصعب مقاومتها.    عطر انيق مناسب لكل الأوقات.', 'An elegant aromatic fragrance for men that was released in 2015.  With notes of grapefruit, mandarin, neroli, olibanum, musk, and sandalwood.   Beautiful scent that is irresistible.  The perfect scent for every occasion.', '1648135779192WhatsApp Image 2022-03-20 at 15.25.35.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2424, 143),
(2430, 'دانهيل لندن ايكون للرجال – او دو بارفان', 'Dunhill London Icon for Men Eau de Parfum', '439', '210', NULL, 'المكونات العليا: البرجموت الطازج، ومستخلص زهر البرتقالي المكونات الوسطى: تحتوي على التوابل ونفحات من الفلفل الأسود، واللافندر، والكارداموم. المكونات الأساسية: العود المدخن، ونجيل الهند، والجلد، وطحلب البلوط', 'Top notes: fresh bergamot, orange blossom extract Middle notes: Spicy and notes of black pepper, lavender and cardamom. Base notes: smoked agarwood, vetiver, leather and oak moss', '1648136030868WhatsApp Image 2022-03-20 at 15.25.35 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2425, 143),
(2431, 'أو دي تواليت ديزاير بلو من دانهيل', 'Dunhill Desire Blue Eau De Toilette', '300', '115', NULL, 'إضافة رائعة إلى أغراضك تتمثل في هذا العطر الرائع، مصمم بتركيبة فريدة ورائحة لا تضاهى، ومصنوع من مواد عالية الجودة، ويأتي في عبوة فاخرة.', 'Some say, fragrance is an invisible part of your personal style and it has a powerful effect on how people see and remember you. So, whether you are going out for a casual dinner, having a night out, or going for business meetings, men should wear their best perfume.', '1648136167541WhatsApp Image 2022-03-20 at 15.25.36.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2426, 143),
(2432, 'عطر ديزاير ريد من دنهل للرجال - او دي تواليت', 'Dunhill Desire Red For Men - Eau De Toilette', '300', '195', NULL, 'ديزاير ريد هو عطر يتميز برائحة المكونات الشرقية مع التوابل تم اصدارة 2000.  يبدأ تكوينه بالبرغموت والليمون والتفاح وزهر البرتقال.  الطبقة الوسطى تحتوي على الورد وخشب الساج والباتشولي.  قاعدة العطر من المسك والفانيليا.  رائحه جذابه تمنحك الثقة المطلقة.  عطر انيق مناسب لكل الأوقات.', 'Desire Red by Dunhill is Oriental-Spicy fragrance for men that was released in 2000 .  Its composition starts of bergamot, lemon, neroli and apple.  Middle notes are rose, teak wood and patchouli.  Base notes are musk and vanilla.  You feel better when you smell good.  The perfect scent for every occasion.', '1648136361483WhatsApp Image 2022-03-20 at 15.25.36 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2427, 143),
(2433, 'دنهل آيكن إيليت أو دو برفان', 'DUNHILL Icon Elite Eau de Parfum', '300', '195', NULL, 'ايكون اليت يجسد شكلا فريدا من الفخامة المذكر البريطاني ونداء لكل زمان. مع روح حار وودي هو مبني حول مزيج صلب المكونات: الهيل، نجيل الهند وخشب الصندل.', 'Icon Elite embodies a unique form of British masculine luxury and timeless appeal. Its woody-spicy soul is constructed around a core blend of notes: Sicilian Bigarade, Vetiver and Sandalwood.', '1648136529121WhatsApp Image 2022-03-20 at 15.25.36 (2).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2428, 143),
(2434, 'عطر ايكون ريسنج جرين من دنهل للرجال - أو دو برفيوم', 'Dunhill Icon Racing Green For Men - Eau de Parfum', '439', '195', NULL, 'عطر اروماتيك مثير يناسب الرجل العصري الباحث عن التميز والتفرد في عصر السرعة تم اطلاقه عام 2017.  يبدأ العطر بمكونات عليا من الهيل والجريب فروت والبرغموت الحمضي.  ثم ينتقل إلى المكونات الوسطى للخزامى العطري والفلفل الحار وزهر البرتقال الطازج.  تضيف الروائح الأساسية لمسة من الاناقة مع لمحات من المسك الترابي ونجيل الهند الخشبي وخشب الغاياك.  الاختيار المثالي لرائحة عطرة و رقي لا حدود له.', 'A sexy aromatic fragrance that suits the modern man looking for excellence and exclusivity in the age of speed It was launched in 2017.  The cologne opens with the top notes of sweet cardamom, juicy grapefruit, and citrusy bergamot.   It then transitions into the middle notes of aromatic lavender, spicy pepper, and fresh orange blossom.   The base notes add a touch of complexity with hints of earthy musk, woody vetiver, and exotic guaiac wood.  Icon Racing embodies a fresh aroma for men on the m', '1648136982530WhatsApp Image 2022-03-20 at 15.25.37.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2429, 143),
(2435, 'عطر روجر اند غاليت للرجال،  او دي تواليت', 'Open by Roger & Gallet for Men Eau de Toilette', '80', '65', NULL, 'تم إطلاقه بواسطة العلامة التجارية  روجر اند غاليت يمتلك هذا العطر الرجالي رائحة تدوم طويلا يبقيك منتعش طوال اليوم', 'Launched by the brand Roger & Gallet This Perfume for men holds a long lasting fragrance Keeps you refreshing all day', '1648137105995WhatsApp Image 2022-03-20 at 15.25.37 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:36', NULL, NULL, NULL, NULL, 2430, 143),
