(2437, 'ارماند باسي ان ريد للنساء -او دو بارفان-', 'Armand Basi In Red Eau de Parfum for for Women', '276', '135', NULL, 'تتطلب المرأة الأنيقة والمتطورة عطرًا يعزز حضورها ، ويملأ أرماند باسي باللون الأحمر تلك الحاجة. تم إطلاق رذاذ ماء العطر هذا في عام 2006 ، مع مزيج حار وحيوي من الزنجبيل وبرتقال اليوسفي المنعش. قلب الأزهار الناعم والحلو قليلاً يحتوي على الورد البودرة والياسمين المعطر ملفوف في قاعدة ترابية تغلب عليها المسك لإطالة العمر. احصلي على هذه الرائحة المتوازنة تمامًا من دار التصميم الأسباني ارماند باسي ان ريد في أيام الربيع الدافئة وأمسيات الصيف الدافئة.', 'A sleek, sophisticated woman requires a fragrance that enhances her presence, and Armand Basi in Red fills that need. This eau de parfum spray, launched in 2006, unfolds with a spicy and lively infusion of ginger and tangy mandarin orange. The soft and slightly sweet floral heart includes powdery rose and fragrant jasmine wrapped in an earthy base laced with musk for longevity. Reach for this perfectly balanced scent from the Spanish design house of Armand Basi on warm spring days and balmy summ', '1648137723887WhatsApp Image 2022-03-20 at 15.25.39 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2432, 143),
(2438, 'عطر ون مان شو من جاك بوجارت للرجال  - بخاخ او دي تواليت', 'Jacques Bogart One Man Show - perfume for men', '169', '55', NULL, 'يحتوي هذا العطر الشيبر على مزيج من طحلب السنديان والجلد والقرنفل وخشب الأرز وجوزة الطيب والريحان وخشب الصندل', 'This chypre fragrance has a blend of oakmoss, leather, cloves, cedarwood, nutmeg, basil and sandalwood.', '1648137918258WhatsApp Image 2022-03-20 at 15.25.40.jpeg', 5, 124, '', '', '100 ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2433, 143),
