(2440, 'دنهل بلاك او دي تواليت للرجال', 'Dunhill Black Eau de Toilette for Men', '270', '110', NULL, 'المكونات العليا: أوراق شجر القراص المكونات الوسطى: اللافندر، الياسمين الشفاف. الروائح الأساسية: خشب الأرز المسكي والروائح الخشبية الغاياك', 'Top notes: nettle leaf Middle notes: lavender, transparent jasmine. Base notes: musky cedar and guaiac woody notes', '1648139196612WhatsApp Image 2022-03-20 at 15.25.41.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2435, 143),
(2441, 'عطر رومبا نسائي أو دو تواليت', 'Rumba Perfume By Ted Lapidus for Women', '160', '75', NULL, 'اقوى البرفانات الحريمى من أجل النساء اللاتي يبحثن عن الكلاسيكية ويعشقونها كثيرا إليكم هذا العطر الكلاسيكي القديم والمميز من متجر مومنتس . عطر نسائي ممزوج برائحة الماضي والذكريات السعيدة المبهرة يجعلك تعيشين في هالة من السعادة والسرور . احصلي عليه الآن', 'The most powerful womens perfumes for women who are looking for classics and love them so much. Here is the classic and distinctive perfume from the Moments store. A womens fragrance mixed with the scent of the past and dazzling happy memories that makes you live in an aura of happiness and pleasure. Get it now', '1648139329550WhatsApp Image 2022-03-20 at 15.25.42.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2436, 143),
(2442, 'بينيتون تريبيو للنساء -او دي تواليت', 'Tribu by Benetton for Women - Eau de Toilette', '150', '85', NULL, 'هذا المنتج مصنوع من مواد عالية الجودة ويوصى به للارتداء الرومانسي هذا المنتج صنع في إيطاليا الذي قدمته بينيتون في عام 1993 تم تصنيف تريبو على أنه عطر منمق حاد. العنبر يوصى به للارتداء الكاجوال.', 'This product is made of high quality material It is recommended for romantic wear This Product Is Manufactured In Italy Introduced by benetton in 1993 tribu is classified as a sharp flowery fragrance This perfume has a blend of fruits with floral mid-notes lower notes of sandalwood and amber It is recommended for casual wear.', '1648139523694WhatsApp Image 2022-03-20 at 15.25.44.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2437, 143),
(2443, 'جيرلان عطر كوير إنتنس أو دو برفان', 'GUERLAIN Cuir Intense Eau de Parfum', '1130', '950', NULL, 'هذا العطر الخشبي الشرقي من مجموعة ابسوس دورينت لجيرلان مستوحى من الجلد، وهو جزء من تقليد يمتد لألف عام في الشرق. عطر كيور انتنس أو دو برفان هو عطر للرجال والنساء، حيث يقوم العطار تييري واسر ببناء التنوع بين المكونات الخشبية القوية وزهرة الأوسمانثوس بجوانبها الفاكهية من المشمش الخفيف.', 'This woody oriental fragrance from Guerlains Absolus dOrient collection is inspired by leather, which is part of a thousand-year tradition in the Orient. Cuir Intense is a fragrance for men and women, the Perfumer, Thierry Wasser, builds diversity between the powerful woody leathery notes and the luminous osmanthus flower with its light fruity apricot facets.', '1648139697490WhatsApp Image 2022-03-20 at 15.25.47.jpeg', 5, 124, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2438, 143),
(2444, 'عطر سانتال رويال من جيرلان - او دي بارفيوم', 'Guerlain Santal Royal - Eau De Parfum', '731', '580', NULL, 'عطر مميز للنساء والرجال شرقي تم اصدارة2014  تتكون تركيبته العطرية من الياسمين و زهرة البرتقال و الورد والخوخ و القرفة و خشب الصندل و الجلد و العنبرو العود والمسك  رائحه جذابه تمنحك الثقة المطلقة  عطر انيق مناسب لكل الأوقات', 'An elegant oriental fragrance for both Men & Women that was released in 2014  With notes of  jasmine ,neroil ,rose ,peach, rose, cinnamon, santalwood, leather , amber , oud and musk  You feel better when you smell good.  The perfect scent for every occasion', '1648140138359WhatsApp Image 2022-03-20 at 15.25.47 (1).jpeg', 5, 124, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:35:27', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2439, 143),
(2445, 'جيرلان أنسان ميتيك أو دو برفان', 'GUERLAIN Encens Mythique Eau De Parfum', '731', '495', NULL, 'بخور زائل لا يترك سوى أثر عابر من عطره في حين تطبع الورود لمساته الكثيفة. إلا أن الحلاوة الأبدية والعمق الاستثنائي ينتجان عن عنبر نيو زيلاندا الأصيل والعظيم الذي اختاره تييري واسر خصيصاً لعطره. أنشودة غامضة لتكريم عالم مكرّس للأبدية.', 'An ethereal frankincense leaves only a fleeting mark on this fragrance, while rose imprints its fiery accents. But the endless sweetness and exceptional depth come from authentic and majestic ambergris of New Zealand, specially selected by Thierry Wasser for this fragrance. An enigmatic opus to sing the praises of a world devoted to eternity.', '1648140155733WhatsApp Image 2022-03-20 at 15.25.48.jpeg', 5, 124, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2440, 143),
(2446, 'عطر جيرلان سمسارا او دو بارفيوم', 'Guerlain Samsara Eau De Parfum', '450', '240', NULL, 'الخط العطري: اروينتال وودي تفوح منه خلاصات البرغموت والدراق والليمون. ممزوج بمكونات الياسمين واليلانغ يلانغ والفانيليا. عطر ذو نموذج رومانسي.', 'Aromatic line: Oriental Woody Smelling essences of bergamot, peach and lemon. Blended with notes of jasmine, ylang-ylang and vanilla. Romantic perfume.', '1648140307518WhatsApp Image 2022-03-20 at 15.25.50.jpeg', 5, 124, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2441, 143),
(2447, 'جيرلان باتشولي أردان أو دو برفان', 'GUERLAIN Patchouli Ardent Eau De Parfum', '831', '610', NULL, 'مع بتشولي أردان Patchouli Ardent، أعاد تييري واسر، صانع العطور الرئيسي لدى جيرلان Guerlain، ابتكار البتشول، وهو مكوّن خام يكون في العادة غنيّاً برائحة الأخشاب الداكنة وغامض، بطريقة حيويّة وزاهية بشكلٍ مفاجئ. وهو يدمج بين أناقة الورد وجلد ملوكي وتوافق من المسك لتقديم رحلة حسيّة فريدة.', 'With Patchouli Ardent, Thierry Wasser, Guerlains master Perfumer, has reinvented patchouli, a raw material usually darkly woody and mysterious, in a surprisingly vibrant and bright way. It combines the elegance of Rose with a majestic leather and musks accord to offer a unique sensorial voyage.', '1648140476528WhatsApp Image 2022-03-20 at 15.25.51.jpeg', 5, 124, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2442, 143),
