(2450, 'عطر نارتسيسو رودريغيز من نارتسيسو رودريغيز للنساء، 100 مل', 'Narciso Rodriguez by Narciso Rodriguez 100ml Eau de Parfum Spray for Women', '580', '395', NULL, 'تم طرحه عام 2003 من قبل دار التصميم نارتشيسو رودريغيز هذه الرائحة الأنثوية تشكل مزيجًا من الفلفل الوردي واللافندر والباتشولي والبنفسج والعنبر والخشب يُصنف على أنه عطر أنثوي.', 'Introduced in 2003 by the design house of Narciso Rodriguez This feminine scent is a blend of pink pepper, lavender, patchouli, violet, amber, and woods It is classified as a feminine fragrance.', '1648146538090WhatsApp Image 2022-03-20 at 15.26.11 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2445, 143),
