(2452, 'عطر روج من نارسيسو رودريغز للنساء - او دي بارفيوم', 'Narciso Rodriguez Narciso Rouge For Women - Eau De Parfum', '575', '450', NULL, 'عطر نسائي خشبي مميز صدر عام 2018.  تتكون تركيبته العطرية من لسوسن والورد والمسك وزهر البرتقال والفانيليا وخشب الصندل.  عطر انيق مناسب لكل الأوقات.', 'An elegant woody musk fragrance for women that was released in 2018.  Enriched with notes of iris, rose, musk, orange blossom, vanilla, and sandalwood.   The perfect scent for every occasion', '1648145504909WhatsApp Image 2022-03-20 at 15.26.10 (1).jpeg', 5, 124, '', '', '90ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2447, 143),
(2453, 'عطر جيفنشي جنتل مان انتنس او دو تواليت', 'Givenchy Gentleman Intense Perfume Eau de Toilette', '430', '240', NULL, 'تكشف جنتلمان جيڤنشي عن عطر ماء تواليت إنتنس الجديد، وهو عطر زهري خشبي يجمع بين اللُطف والقوة.    يمثل البرغموت المتوهج والريحان وحب الهال افتتاحية هذا العطر برائحة آسرة ونضارة حاضرة، وتزداد الرائحة تألقًا بزهرة السوسن الأزرق اللطيفة.    ثم تزداد الرائحة عُمقًا بخشب الأرز القوي الغني بالرائحة وكذلك الكومارين الناعم.', 'Gentlemans Givenchy unveils the new Intense Eau de Toilette, a woody floral fragrance that combines gentleness and strength.    Radiant bergamot, basil and cardamom open this fragrance with captivating aroma and present freshness, heightened by the gentle blue iris flower.    The scent is then deepened by strong, aromatic cedarwood as well as soft coumarin.', '1648145647289WhatsApp Image 2022-03-20 at 15.26.09 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2448, 143),
(2454, 'عطر نارسيسو رودريغز روز مسك بارفيوم للنساء', 'Narciso Rodriguez Rose Musk Parfum for Women', '940', '540', NULL, 'روز مسك هو عطر حصري ذو جوانب نابضة بالحياة. إنها حساسة وثمينة. الطبقة العليا ، خلاصة الورد المغربي الثمين ، تضفي إحساسًا دافئًا ولمسة من العسل والتوابل. يبرز قلب المسك المميز من نارسيسو رودريغيز روائح الأزهار البودرة والفواكه قليلاً للعطر. يتم تضخيم هذا الإبداع الحصري من خلال الفلفل الأسود والزعفران اللذان يضفيان الطابع والتشديد والنغمة الجلدية الدقيقة على التركيبة. في القاعدة ، تجلب الأخشاب السوداء عمقًا رائعًا للانتشار. اكتشف مجموعة Musc ، عطور ذات تأثير كثيف وآسر. دعوة إلى رحلة عطرية فريدة', 'Rose Musc is an exclusive perfume with vibrant facets. Its delicate and precious. The top note, the precious Moroccan rose absolute, brings a warm feeling and a hint of honey and spices. The Narciso Rodriguez signature heart of musc highlights the floral powdery and slightly fruity notes of the fragrance. This exclusive creation is further magnified by black pepper and saffron that give character, emphasis, and a subtle leathery tone to the composition. At the base, black woods bring a sublime', '1648145791201WhatsApp Image 2022-03-20 at 15.26.09 (2).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2449, 143),
(2455, 'نارسيسو رودريغيز بيور مسك لها أو دي بارفان سبراي', 'NARCISO RODRIGUEZ PURE MUSC FOR HER EAU DE PARFUM SPRAY', '670', '400', NULL, 'بيور مسك لها من نارسيسو رودريغيز هو عطر مسك خشبي زهري للنساء تم إطلاقه في عام 2019. أفضل ملاحظة هو المسك ؛ المذكرة الوسطى هي الزهور', 'PURE MUSC FOR HER BY NARCISO RODRIGUEZ IS A FLORAL WOODY MUSK FRAGRANCE FOR WOMEN LAUNCHED IN 2019. TOP NOTE IS MUSK; MIDDLE NOTE IS FLOWERS; BASE NOTE IS CASHMERAN. INSPIRED BY THE ORIGINAL FOR HER FOR HER PURE MUSC EAU DE PARFUM PAYS HOMAGE TO THE ICONIC FRAGRANCE LINE S SIGNATURE MUSC. THE RESULT IS INTOXICATING', '1648146179796WhatsApp Image 2022-03-20 at 15.26.07.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2450, 143),
(2456, 'عطر فور هير من نارسيسو رودريغز للنساء - أو دو تواليت', 'Narciso Rodriguez For Her For Women - Eau de Toilette', '570', '350', NULL, 'عطر زهري من باقة عطور نارسيسو رودريقوز الفرنسية الراقية تم اطلاقة عام 2003.  يمنحك الأناقة والإغراء والحسية بفضل رائحة زهرة البرتقال الأفريقي و البارغموت و المسك و العنبر و نجيل الهند و الفانيليا والباتشولي.  رائحه جذابه تمنحك الثقة المطلقة.  لتكن رائحة عطرك الزكية خالدة.', 'A floral fragrance for women that launched in 2003.  With notes ofafrican orange flower, bergamot ,musk ,amber, vetiver, vanille and patchouli.  You feel better when you smell good.  The perfect scent for special occasions.', '1648146512494WhatsApp Image 2022-03-20 at 15.26.06.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2451, 143),
(2457, 'عطر باي من جيفنشي للرجال - أو دو تواليت', 'Givenchy Pi For Men - Eau de Toilette', '380', '235', NULL, 'عطر رجالي مميز شرقي تم إصداره 1998.  تتكون تركيبته العطرية من الريحان وإكليل الجبل وزهر البرتقال وزنبق الوادي والفانيليا والتونكا واللوز وخشب الأرز.  هذا هو العطر الذي يمثل شخصيتك المميزة.  عطر  انيق مناسب لكل الأوقات.', 'An elegant oriental fragrance for Men that was released in 1998.  An intense and sensual fragrance that has notes of basil, rosemary, neroli, lily of the valley, vanilla, tonka, almond & cedar.  Your fragrance can be your identity.  The perfect scent for every occasion.', '1648146600248WhatsApp Image 2022-03-20 at 15.26.05.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2452, 143),
(2458, 'بخاخ بلو ليبل من جيفنشي - او دي تواليت', 'GIVENCHY POUR HOMME BLUE LABEL EAU DE TOILETTE', '385', '225', NULL, 'تحتوي المكونات الافتتاحية لعطر بور اوم بلو لبيل من جيفنشي على مزيج مهدئ من البرغموت والجريب فروت.  قلب عطر بور اوم بلو ليبل ممتلئ بروائح الشيح والهيل والفلفل والخزامى العطرية. العناصر الأساسية من عطر بور اوم بلو ليبل جيفنشي يتكون من الأوليبانوم ونجيل الهند والأرز.', 'The opening notes of this Givenchy Pour Homme Blue Label perfume contain a soothing blend of bergamot and grapefruit. The heart of this Pour Homme Blue Label perfume is filled with aromatic notes of wormwood, cardamom, pepper and lavender. The base notes of this Pour Homme Blue Label Givenchy perfume consist of olibanum, vetiver, and cedar.', '1648147113352WhatsApp Image 2022-03-20 at 15.26.04.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2453, 143),
(2459, 'عطر جنتلمان أونلي من جيفنشي للرجال - أو دو تواليت', 'Givenchy Gentlemen Only For Men - Eau de Toilette', '570', '270', NULL, 'عطر رجالي مميز خشبي تم إصداره 2013.  تتكون تركيبته العطرية من الفلفل الوردي والبارغموت وجوزة الطيب والباتشولي واخشاب الأرز والمسك والبخور.  يمنحك رائحة عطرية جذابة لكل من حولك .  عطر انيق مناسب لكل الأوقات .', 'An elegant woody fragrance for Men 2013.  With notes of Pink pepper, bergamot ,nutmeg ,patchouli ,cedar, musk ,incense.  It gives you an attractive aromatic scent to everyone around you.  An elegant fragrance is suitable for all times.', '1648147240500WhatsApp Image 2022-03-20 at 15.26.04 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2454, 143),
