(2461, 'عطر إنسنس ألترامارين بتركيز ماء العطر', 'Insense Ultramarine EDT', '487', '210', NULL, 'إن سينس ألترامارين من جيفنشي هو عطر فاكهي عطري للرجال. مثالي لوقت الصيف. نبذة عن العلامة التجارية: جيفنشي هي أزياء وإكسسوارات وعطور فرنسية أسسها الكونت هوبرت دي جيفنشي في عام 1952. تأسست بيرفيومز جيفنشي في عام 1957، وكان أول عطر لهم هو LInterdit، مستوحى مرة أخرى من أشهر عملائها أودري هيبورن. تم إطلاق أول رائحة عطر للرجال، مسيو دي جيفنشي، في عام 1959.', 'In Sense Ultramarine by Givenchy is a fruity aromatic fragrance for men. Perfect for summer time. About the brand: Givenchy is a French fashion, accessories and fragrances business founded by Count Hubert de Givenchy in 1952. Parfums Givenchy was founded in 1957, and their first fragrance was LInterdit, once again inspired by her most famous client, Audrey Hepburn. The first fragrance for men, Monsieur de Givenchy, was launched in 1959.', '1648147584300WhatsApp Image 2022-03-20 at 15.26.02.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2456, 143),
(2462, 'عطر اكسيريوس روج من جيفنشي للرجال - أو دو تواليت', 'Givenchy Xeryus Rouge For Men - Eau de Toilette', '430', '230', NULL, 'عطر رجالي شرقي - فوچير مميز تم إصداره عام 1995.  تتكون تركيبته العطرية من الصبار و البرتقال الصيني و نبات الطرخون و الفلفل الحلو الاسباني و زهور إبره الراعي الأفريقية و أخشاب الأرز و خشب الصندل و أخشاب الأرز و المسك الأبيض.  لرجل غامض ،عصري وأنيق.  عطر  انيق مناسب لكل الأوقات', 'An elegant Oriental Fougere fragrance for Men that was released in 1995.  With notes of   Cactus, Chinese Orange, Tarragon, Pimento, African Geranium and Cedar, Sandalwood, Cedar and White Musk.  For the mysterious, modern and elegant man.  The perfect scent for every occasion.', '1648148110024WhatsApp Image 2022-03-20 at 15.26.02 (1).jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2457, 143),
(2463, 'عطر انستانت ماجيك من جيرلان بارفيوم', 'Instant Magic Perfume by Guerlain Parfum', '595', '495', NULL, 'عطر لانستان ماجيك هو جزء من مجموعة عطور جيرلان الأسطورية. مجموعة مؤلّفة من عطور رمزيّة ومصمّمة منذ أكثر من قرنٍ من قِبل خمسة أجيال من صانعي العطور. تشكّل هذه العطور الأسطورية الرائدة مكتبةَ عطريّة فريدة تجهد دار جيرلان للمحافظة عليها.', 'LInstant Magic is part of Guerlain’s Legendary fragrance collection A collection made of emblematic fragrances, composed for more than a century by 5 generations of Perfumers. These mythical pioneer perfumes compose a unique olfactive library, that the Maison Guerlain endeavors to preserve', '1648148145070WhatsApp Image 2022-03-20 at 15.26.01 (1).jpeg', 5, 124, '', '', '75ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2458, 143),
(2464, 'عطر لانتيردي من جيفينشي للنساء - او دي بارفيوم', 'Givenchy Linterdit For Women - Eau de Parfum', '585', '370', NULL, 'عطر نسائي مميز شرقي تم اصدارة 2018.  تتكون تركيبته العطرية من الكمثرى والبارغموت وزهور البرتقال ومسك الروم والفانيليا والأمبروكسان ونجيل الهند والباتشولي.  للإحساس بالرفاهية المطلقة.  عطر  انيق مناسب لكل الأوقات.', 'An elegant oriental fragrance for Women that was released in 2018.  With notes of Pear, bergamot, orange flowers, tuberose, vanilla, ambroxan, vetiver and patchouli.  The luxury of freedom.  The perfect scent for every occasion.', '1648148494125WhatsApp Image 2022-03-20 at 15.26.00.jpeg', 5, 124, '', '', '80ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2459, 143),
(2465, 'عطر لا انترديت روج من جيفنشي للنساء - او دي بارفيوم', 'Givenchy L interdit Rouge For Women - Eau de Parfum', '580', '490', NULL, 'عطر زهري شرقي أنيق للنساء تم إصداره في عام 2021.  تبدأ رائحة العطر بالزنجبيل و البرتقال الأحمر.  بينما قلب العطر يحتوي على مسك الروم و الياسمين و أوراق البيمينتو  .  محاطة برائحة القاعدة التي تحتوي على الباتشولي و خشب الصندل و نجيل الهند.  هذا العطر المميز مناسب لكل أوقاتك لمزيد من الجاذبية.', 'elegant oriental floral fragrance for women launched in the year 2021.  The fragrance starts with ginger and red orange.  While the heart of the perfume contains tuberose, jasmine, and pimento leaves.  Surrounded by base notes that contain patchouli, sandalwood, and vetiver.  This distinctive fragrance is suitable for all your times for more attractiveness.', '1648145118720WhatsApp Image 2022-03-20 at 15.25.59.jpeg', 5, 124, '', '', '80ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2460, 143),
(2466, 'انتنس ، جيفنشي لينترديت - او دي بارفان', 'Intense, GIVENCHY LInterdit - Eau de Parfum', '635', '480', NULL, 'إذا كان لينترديت، الذي ابتكره في عام 1957 ، أول عطر جريء في الدار ، فإن  او دي بارفان الذي تم إطلاقه في عام 2018 يجسد تشويقًا جديدًا قويًا لا يُنسى غزا جميع النساء. لم يعد الممنوع دعوة ، إنه إدمان. واليوم ، يضخم عطر انتنس ، جيفنشي لينترديت - او دي بارفان هذه الإثارة برائحة الأزهار الشرقية الخشبية فائقة التطور والحازمة. عطر حلو ومكثف.', 'If LInterdit, created by Hubert de Givenchy in 1957, was the Houses first audacious fragrance, the Eau de Parfum launched in 2018 embodies a powerful and memorable new thrill that has conquered all women. The Forbidden is no longer an invitation, it is an addiction. Today, LInterdit, Eau de Parfum Intense amplifies this thrill with an ultra-sophisticated and resolutely Couture woody-floral oriental fragrance. A sweet and intense fragrance.', '1648145272874WhatsApp Image 2022-03-20 at 15.25.59 (1).jpeg', 5, 124, '', '', '80ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2461, 143),
(2467, 'عطر أماريج من جيفنشي للنساء - او دي تواليت', 'Givenchy Amarige For Women - Eau de Toilette', '530', '270', NULL, 'جيفنشي اماريج عطر زهري مصمم للنساء المتطورة. اطلق عام 1999.  تتكون تركيبته العطرية من براعم البرتقال و الخوخ و البرقوق و زهر البرتقال و خشب الورد البرازيلي و اليوسفي و البنفسج و مسك الروم و الغردينيا و الإيلنغ و الياسمين و القرنفل و التوت الأحمر و الكشمش الأسود و الأوركيد و خشب الصندل و الرائحة الخشبية و الفانيليا و العنبر و التونكا و المسك وخشب الأرز  رائحه جذابه تمنحك الثقة المطلقة    عطر انيق مناسب لكل الأوقات', 'An elegant floral-fruity fragrance for Women that was released in 1991.  with notes of  orange blossom, peach, plum, neroli, brazilian rosewood, mandarin , violet, tuberose, gardenia, ylang-ylang ,jasmine, carnation, red berries, black currant, ,orchid, sandalwood, woody notes, vanilla, amber, tonka bean, musk and cedar.  You feel better when you smell good.  The perfect scent for every occasion', '1648145632632WhatsApp Image 2022-03-20 at 15.25.58.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2462, 143),
(2468, 'جيفنشي داليا ديفين أو دو برفان', 'GIVENCHY Dahlia Divin Eau de Parfum', '590', '370', NULL, 'يشيد عطرجيفنشي داليا ديفين أو دو برفان من جيفنشي ، المضيء والأنيق ، بقوة المرأة العصرية. تحتوي زجاجة الجوهرة المستوحاة من الأزياء الراقية على رائحة مشرقة تغلف البشرة بمزيج متلألئ من برقوق ميرابيل والياسمين الحلو وأوتار الورد ، مدبب بلطف مع جاذبية خشب الصندل. تعكس القارورة الفاخرة تألق العطر بشكله الظلي المتميز ولمسات الذهب المتلألئة.', 'Luminous and elegant, Givenchy’s Dahlia Divin Eau de Parfum pays tribute to the power of the modern-day woman. Its couture-inspired jewel bottle encloses a radiant scent that envelopes the skin in a sparkling blend of Mirabelle plum, sweet jasmine and rose chords, gently tapered with the sensuality of sandalwood. The luxurious flacon echoes the brilliance of the fragrance with its distinct silhouette and gleaming hints of gold.', '1648145783266WhatsApp Image 2022-03-20 at 15.25.58 (1).jpeg', 5, 124, '', '', '75ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2463, 143),
(2469, 'عطر اودموزيل دي جيفنشي من جيفنشي للنساء - او دي تواليت', 'Givenchy Eaudemoiselle de Givenchy For Women - Eau de Toilette', '409', '295', NULL, 'عطر نسائي مميز زهري تم إصداره في عام 2010.  تتكون تركيبته العطرية من الليمون والريحان واليوسفي وصبغة الورد والإيلنغ والمسك والأمبريت والتونكا.  للإحساس بالرفاهية المطلقة.  عطر انيق مناسب لكل الأوقات.', 'An elegant floral fragrance for Women that was released in 2010.  with notes of lemon, basil ,tangerine, tincture of rose ,ylang-ylang ,musk, ambrette and tonka bean.  The luxury of freedom.  The perfect scent for every occasion.', '1648145985037WhatsApp Image 2022-03-20 at 15.25.57.jpeg', 5, 124, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2464, 143),
