(2557, 'عطر جيرل اوف ناو من ايلي صعب للنساء - او دي بارفيوم', 'Elie Saab Girl Of Now For Women - Eau De Parfum', '490', '300', NULL, 'عطر نسائي مميز شرقي زهري تم اطلاقه عام 2017.  يستفتح العطر بلمسة فاكهية مع نفحات من برتقال اليوسفي والفستق والكمثرى.  تشكل مكونات الأزهار قلب العطر لإضافة المزيد من النعومة والأنوثة إلى الرائحة.  في القاعدة مزيج فريد من المكونات بما في ذلك اللوز والكشمير والباتشولي وحبوب التونكا.  الرائحة المثالية لكل مناسبة.', 'An elegant oriental floral fragrance for women was released in 2017.  The sophisticated scent starts with a fruity twist with top notes of mandarin orange, pistachio, and pear.   Floral notes make up the heart of the fragrance to add some extra softness and femininity to the scent.   At the base are a unique blend of notes, including almond, cashmere, patchouli, and tonka bean.  The perfect scent for every occasion.', '1648555286820WhatsApp Image 2022-03-28 at 13.29.19 (1).jpeg', 5, 113, '', '', '90ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2553, 132),
(2558, 'عطر باريس بقلم إيف سان لوران للنساء', 'Paris Perfume By YVES SAINT LAURENT FOR WOMEN', '578', '395', NULL, 'عطر باريس من إيف سان لوران. سميت على اسم المدينة مرادفًا للسحر والرومانسية ، يعكس عطر باريس النسائي الذي يحمل الاسم نفسه. تم طرح هذا العطر من دار إيف سان لوران عام 1983 ، وهو يقدم باقة جذابة من النوتات العطرية. أضف طابعًا مميزًا إلى مجموعة عطرك ، وانغمس في مزيج الأزهار والتوابل الذي يجعل من باريس نسمة منعشة. تتوازن أزهار البرتقال والورد والميموزا مع القرفة والنوتات الخضراء في هذا العطر الأنثوي الخادع الذي ينضح بالذوق الباريسي.', 'Paris by Yves Saint Laurent Perfume. Named for the city synonymous with glamour and romance, Pariss fragrance for women reflects its namesake. Introduced in 1983, this creation from the house of Yves Saint Laurent delivers an enticing bouquet of aromatic notes. Add cachet to your fragrance collection, and indulge in the floral and spice blend that makes Paris such a breath of fresh air. Orange blossom rose and mimosa are balanced by cassia and green notes in this beguiling feminine scent that e', '1648555394435WhatsApp Image 2022-03-28 at 13.29.19 (2).jpeg', 5, 113, '', '', '125ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:37', NULL, NULL, NULL, NULL, 2554, 132),
(2559, 'بودرة معطرة للجسم من فرانك اوليفر', 'Perfumed body powder from Franck Oliver', '340', '150', NULL, 'بودرة جسم معطرة برائحة زهرة الفريزيا الفواحه.  ستمنح بشرتك ملمسا مخمليا ناعما ورائحة زكية تدوم طويلا.  تتميز بأن جميع المكونات آمنة على البشرة.  متعددة الاستخدامات مناسبة لجميع أنواع البشرة ، بما فيها البشرة الحساسة.  اختيار منعش لاحساس مريح طوال اليوم', 'Body powder scented with the scent of the fragrant freesia flower.  It will give your skin a velvety smooth texture and a long lasting fragrance.  All ingredients are safe for the skin.  Versatile, suitable for all skin types, including sensitive skin.  A refreshing choice for a comfortable feeling all day long', '1648556089847WhatsApp Image 2022-03-28 at 13.29.20.jpeg', 5, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2555, 132),
(2560, 'عطر فرانك اوليفير من فرانك اوليفير للنساء - او دي برفيوم', 'Franck Olivier Franck Olivier For Women - Eau De Perfum', '219', '90', NULL, 'عطر نسائي مميز زهري فواح من فرانك اوليفير تم اصدارة 1998.  أختر عطرًا يميزك.   تتكون تركيبته العطرية من الخوخ و البرقوق و الكشمش الأسود و الجريب فروت و الإيلنغ و الياسمين و الورد و الفانيليا و خشب الصندل والمسك.   عطر انيق مناسب لكل الأوقات.', 'An elegant floral fragrance for Women that was released in 1998.  Feel special with a special fragrance.  With notes of peach, plum, black currant, grapefruit, ylang-ylang, jasmine, rose, vanilla, sandalwood, and musk.  The perfect scent for every occasion.', '1648556361182WhatsApp Image 2022-03-28 at 13.29.20 (1).jpeg', 5, 113, '', '', '75ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2556, 132);
