(2561, 'عطر تشانس من شانيل للنساء - او دي تواليت', 'Chanel Chance For Women - Eau De Toilette', '700', '680', NULL, 'عطر زهري منعش للنساء تم إصداره عام 2003.  غني بالروائح العطرية للفلفل الوردي والياسمين وزهور السوسن والمسك والباتشولي ونجيل الهند.  رائحة جميلة وقوية تدوم طوال اليوم.  خليط عطري فواح مثالي لكل الأوقات والمناسبات.', 'A fresh & floral fragrance for Women that was released in 2003.  Enriched with notes of pink pepper, jasmine, iris, white musk, amber, patchouli & vetiver.  A beautiful, sweet, and strong scent that lasts all day.  The perfect scent for every occasion.', '1648556389668WhatsApp Image 2022-03-28 at 13.29.21.jpeg', 5, 113, '', '', '100ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2557, 132),
(2562, 'عطر كوتش دريم من كوتش للنساء - او دي برفيوم', 'Coach Coach Dreams For Women - Eau De Perfum', '417', '240', NULL, 'عطر نسائي مميز زهري تم اصداره 2020 .  تبدأ برائحة الفواكه، الكمثري والبرتقال المر.  وقلب العطر يحتوي على الغاردينيا وزهر الصبار.  تحيط بها رائحة القاعدة الفاخرة من الأمبروكسان والأخشاب.  هذا العطر الجذاب والمنعش سيأسر كل من حولك.', 'An elegant floral fragrance for Women that was released in 2020   The top notes are Fruits, pears, and bitter orange.  This leads to the middle notes of Gardenia and cactus blossom.  Surround by base notes are Ambroxan and wood.  This perfume will charm everyone around you.', '1648556559764WhatsApp Image 2022-03-28 at 13.29.21 (1).jpeg', 5, 113, '', '', '90ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2558, 132),
(2563, 'عطر فلورال بلاش من كوتش للنساء - او دي برفيوم', 'Coach Floral Blush For Women - Eau De Perfum', '417', '240', NULL, 'عطر نسائي مميز زهري تم اصدارة 2019.  تتكون تركيبته العطرية من الجريب فروت و الفاوانيا و الخوخ و المسك و الاخشاب  رائحه جذابه تمنحك الثقة المطلقة   عطر انيق مناسب لكل الأوقات.', 'An elegant floral fragrance for Women that was released in 2019    with notes of grapefruit , peach , peony , musk , white wood    You feel better when you smell good.  The perfect scent for every occasion', '1648556688356WhatsApp Image 2022-03-28 at 13.29.21 (2).jpeg', 5, 113, '', '', '90ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2559, 132),
(2564, 'ماسكرا سكندلايز من ريميل لندن', 'Rimmel London ScandalEyes Mascara', '30', NULL, NULL, 'ماسكرا سكندلايز من ريميل لندن، تمنحك رموش جذابة بلون أسود فاحم متألق.  غنيه بالكولاجين والكيراتين لتغذية رموشك، فرشاة الماسكرا ممتلئة بألياف ناعمة لتغطي كافة رموشك وتمنحها الكثافة.  اختيار مثالي لمظهر رموش جذابة وكثيفة', 'Mascara created with a lightweight flexible formula to give you intense black color without clumping or smudging.  Easy to apply and with buildable volume to build your own intensity.  Enriched with collagen and keratin to moisturizes and nourishes your lashes.  Leaves you with flawless long lashes.', '1648556943851Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2560, 132),
(2565, 'ماسكرا ووندر فول مقاومة للماء بزيت الارغان من ريميل لندن - اسود 001', 'Rimmel London Wonder Full Waterproof Mascara With Argan Oil - 001 Black', '30', NULL, NULL, 'احصلي على رموش مثالية مع ماسكرا ووندر فول من ريميل لندن بزيت الارغان.  استمتعي بمظهر رموش كثيفة وأكبر حجما بفرشاة صممت لتغطي الرموش من البداية الى الحافة.  ماسكرا سلسة وسهلة الاستخدام ومقاومة للتكتل.  اختيار مثالي للحصول على مظهر عيون جذابة.', 'Have a perfect lash with wonder full mascara with argan oil by Rimmel London.  It is volume and definition of water proof mascara.  Ultra-Flex brush hugs lash defining them from root to tip.  Easy to apply, waterproof, perfectly smooth, and clump-free lashes.  Perfect choice for an attractive eye look.', '1648557059393Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2561, 132),
(2566, 'بورجوا ماسكارا فوليوم كلابينج', 'BOURJOIS Volume Clubbing Mascara', '40', NULL, NULL, 'تم تعزيز ماسكارا المقاومة الفائقة الكثافة من بورجوا بأصباغ معدنية سوداء مكثفة تعمل على تحسين الإمساك.  تضمن الفرشاة ذات الوجهين الحاصلة على براءة اختراع مع حجمها الكبير من الشعيرات اللينة تغطية متساوية للرموش وبدون تكتلات.  لإطلالة المشاهير، احصلي عن عيون مذهلة للغاية طوال الليل! تمنحك ماسكارا فوليوم كلوبينج حجمًا كبيرًا وهي مثالية لقضاء أوقاتك في الليل.  تم تعزيز تركيبته المقاومة للغاية من الفينيل لإطلالة لا تتزحزح طوال الليل! بالإضافة إلى ذلك، فهي 100٪ ضد التمزق والعرق.', 'Ultra-resistant Volume Clubbing Mascara from Bourjois is enhanced by intense black mineral pigments that improve the hold.  Its patented double-sided brush with its high volume of supple bristles ensures even coverage on the lashes and no clumps.  Create your own V.I.P. look for extremely striking eyes all night long! Volume Clubbing Mascara gives you extreme volume, perfect for nights out.  Its extremely resistant formula is enhanced by vinyl for a look that won’t budge all night! Plus, it is 1', '1648557235680Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2562, 132),
(2567, 'ماسكرا تويست اب ذا فوليوم من برجوا - الترا بلاك', 'Bourjois Twist Up The Volume Mascara - Ultra Black', '40', NULL, NULL, 'ماسكرا مذهلة تمنحك رموش أكبر حجمًا وأكثر كثافة بفضل تصميم الفرشاة المميزة وتركيبتها الفريدة.  صُممت فرشاتها بشعيرات دقيقة تصل إلى جميع رموشك من الجذور للأطراف وتغطيها بلون جذاب وطبيعي.  بينما تركيبتها الرائعة تمنح رموشك تأثير الطول والكثافة والانحناء لتزيد من جاذبية عينيك.  مع هذه الماسكرا ستحصلين على رموش جذابة وعيون جميلة بتمريرة واحدة.', 'Get thicker and bigger lashes with this special mascara.  With its buildable, smudge-proof formula, it delivers the best volume and length that lasts all day long.  The brush design was created to reach every single lash and spread its deep color for a great look, even in your lower lashes.  This great mascara will give you attractive eyes.', '1648557352235Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2563, 132),
(2568, 'ماسكرا داي تو نايت مقاومة للماء من ريميل لندن - 001 اسود', 'Rimmel London Day 2 Night Waterproof Mascara - 001 Black', '40', NULL, NULL, 'ماسكرا داي تو نايت من ريميل لندن بتركيبة مقاومة للماء وتدوم لساعات طويلة.  مصممة بجهتين لتحصلي على رموش اكثر طول وكثافة.  الجزء العلوي لتطويل الرموش بطريقة متألقة والجزء السفلي لتكثيف الرموش.  اختيار مثالي يزيد من جمال عينيك.', 'Mascara created with a lightweight flexible formula to give you intense black color without clumping or smudging with its water-proof formula.  Easy to apply and with buildable volume to build your own intensity with its two sides brush.  The top cap lengthens and defines, stretching lashes to new distances, and the bottom cap thickens lashes with oversized volume  Leaves you with flawless long lashes.', '1648557477838Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2564, 132),
(2569, 'عطر برايفت كوليكشن من استي لودر للنساء - 50مل - او دي بارفيوم', 'Estee Lauder Privet Collection For Women - 50ml - Eau De Parfum', '443', '270', NULL, 'عطر نسائي زهري منعش مميز تم اطلاقة عام 1973.   تتكون تركيبته العطرية من الليمون والبرغموت وزهر البرتقال والأقحوان والنرجس وزهر العسل والياسمين واليلانغ يلانغ.  وأيضا الورد والكمثرى وطحلب البلوط والكزبرة والباتشولي وخشب الصندل والعنبر والمسك.   عطر انيق بنفحات مميزة ذو الجانب الساحر.', 'An elegant floral green fragrance for women was released in 1973.  Enriched with notes of Green Notes, Hiacynth, Lime, Bergamot, Orange Blossom, Lemon, Chrysanthemum,  Narcissus, Honeysuckle, Jasmine, Ylang-Ylang, Rose, Pear, Oakmoss, Coriander, Cedar, Patchouli, Sandalwood, Amber, and Musk.  The perfect scent for every occasion.', '1648557586766Capture.PNG', 5, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2565, 132),
(2570, 'انستازيا بيفرلي هيلز‎ زيت براق للجسم', 'ANASTASIA BEVERLY HILLS Shimmer Body Oil', '280', '200', NULL, 'زيت براق للجسم من انستازيا بيفرلي هيلز، هو زيت فاخر وخفيف الوزن للجسم يمنح بشرتك اشراقة بسمرة الشمس. هذه التركيبة الفاخرة الغنية تترك بشرتك باحساس ناعم-حريري، وتتميز برائخة جوز الهند-فانيليا رائعة وانعكاس لؤلؤي يضيء البشرة باشراقة ذهبية. يرج جيدًا قبل الاستخدام.', 'Anastasia Beverly Hills Shimmer Body Oil is a luxe, lightweight body oil that gives skin a sun-kissed glow. This rich, luxurious formula leaves skin with a touchable, silky-soft feel, features a delicate coconut-vanilla scent and has a pearlescent reflect that illuminates the skin with a golden glow. Shake well prior to use.', '1648557775573Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2566, 132),
(2571, 'بورجوا كريم اساس اير مات من برجوا', 'Bourjois Air Mat Foundation', '45', NULL, NULL, 'كريم أساس اير مات من برجوا : تم تطوير كريم الأساس اير مات خصيصاً لإعطاء البشرة ملمس ناعم بدون لمعان ونضارة خالية من العيوب. تحتوي تركيبة هذا الكريم على بودرة لتخفيف لمعان الوجه ولتحصلي على بشرة مطفية مشرقة. كريم أساس اير مات من برجوا يمنحك تغطية كاملة للبشرة بدون شوائب تدوم لمدة 24 ساعة', 'Bourjois Air Mat Foundation: Bourjois Air Mat foundation has been specially developed to give skin a smooth, matte finish that lasts for up to 24 hours. Its non drying, lightweight formula lets skin breathe throughout the day and provides high coverage for a flawless finish. Enriched with mattifying micronized powders, it elimates shine with no mask effect for an undetectable result. Starting at the centre of your face blend the formula outwards and upwards for a flawless finish whilst erasing', '1648554301933Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2567, 132),
(2572, 'بي بي كريم هيلثي مكس من برجوا', 'Bourjois Healthy Mix BB Cream', '45', NULL, NULL, 'بي بي كريم من بورجوا بتركيبة خفيفة تسمح للبشرة أن تتنفس.  معززة بفيتامينات اي وسي وإي وبي 5 التي تمنحك مظهر بشرة نظرة وصحية.  تتميز التركيبة بأنها تمنح البشرة ترطيب يدوم 24 ساعة برائحة الفاكهة الطازجة.  مناسب للاستخدام اليومي.', 'Healthy Mix BB Cream by Bourjois, with an ultra-lightweight formula that lets your skin breathe.  You will have fresh skin looking because it is enhanced with vitamins A, C, E, and B5 that hide fatigue.  It features 24 hours of skin hydration with a fresh, fruity fragrance.  Leaves you with naturally healthy skin looking.', '1648554463355Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2568, 132),
(2573, 'بورجوا كريم أساس هيلثي ميكس مقاوم علامات الإجهاد', 'BOURJOIS Healthy Mix Anti-Fatigue Foundation', '45', NULL, NULL, 'يمنحك كريم الأساس المقاوم لعلامات الإجهاد هيلثي ميكس من بورجوا المظهر الطبيعي الذي سيجعل بشرتك تبدو صحية ومشرقة. مع مزيج من فيتامينات C و EوB5، فإنه يزيل على الفور العيوب وعلامات التعب وفي الوقت نفسه يعزّز إشراقة وحيوية بشرتك.', 'Bourjois Healthy Mix Anti-Fatigue Foundation gives you a rested, natural glow that will make your skin look healthy. With its blend of vitamins C, E and B5, it instantly erases imperfections and signs of fatigue as well as boosts skin radiance for a fresh looking complexion.', '1648554670265Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2569, 132),
(2574, 'كريم اساس فيس فينتي 3 في 1 من ماكس فاكتور', 'Max Factor Facefinity All Day Flawless 3 In 1 Foundation', '50', NULL, NULL, 'تمتعي بمظهر بشرة متألقة بلا شوائب بكريم الأساس 3في1.  بتركيبة فريدة سائلة تجمع لك بين كريم الأساس و البرايمر والمصحح الخافي للعيوب في مستحضر واحد.  قوامه خفيف على البشرة وينساب عليها بكل سلاسة ليسهل عليك الدمج وزيادة كثافته.  اختيار مثالي لمظهر يدوم خلال اليوم.', 'Enjoy the appearance of radiant skin without blemishes with this 3-in-1 foundation.  With a unique liquid formula that combines foundation, primer, and concealer in one product.  Its texture is light on the skin and glides on smoothly to make it easier for you to blend and increase its density.  The perfect choice for a look that lasts through the day.', '1648554772709Capture.PNG', 1, 113, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2570, 132),
(2575, 'شارك مع صديق كاشاريل إدين للسيدات أو دي بارفيوم', 'Cacharel Eden For Women Eau De Parfum', '379', '170', NULL, 'عطر إيدن من كاشاريل ، إيدن هو عطر نسائي زهري بزهور ، وأزهار بيضاء ، ومائية ، وحلوة ، وبودرة ، واتفاقات رئيسية منعشة.', 'Eden Perfume by Cacharel, Eden is a women’s floral perfume with floral, white floral, aquatic, sweet, powdery, and fresh main accords .', '1648657355096WhatsApp Image 2022-03-28 at 13.29.26.jpeg', 5, 113, '', '', '50ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2571, 132),
(2576, 'عطر كاشريل لولو النسائي او دو بارفيوم', 'Lou Lou Perfume By Cacharel for Women', '349', '160', NULL, 'الخط العطري: فلورا الدهيد عطر منعش فاخر للمرأة. ذو رائحة كلاسيكية خالدة أنيقة مثيرة. يمتاز بمكونات من زهر البرتقال والميموزا والبنفسج. معزز بمكونات البوملو وزهر الإجاص والمغنوليا. مكوناته الأساسية تفوح منها رائحة نبات رقيب الشمس والفانيليا والأوركيد والرز. مثالي للمناسبات الخاصة', 'Aromatic line: Flora Aldehyde Luxurious fresh fragrance for women. A classic, timeless, elegant and sexy scent. Features notes of orange blossom, mimosa and violet. Enriched with notes of pomelo, pear blossom and magnolia. Base notes of heliotrope, vanilla, orchid and cedar. Perfect for special occasions', '1648657448181WhatsApp Image 2022-03-28 at 13.29.27.jpeg', 5, 113, '', '', '50ml', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:04', '2022-04-10 09:04:38', NULL, NULL, NULL, NULL, 2572, 132),
