(2656, 'قفص طيور مزخرف 04010866', 'Decorative bird cage 04010866', '130', NULL, NULL, 'قفص طيور الزينة هذا هو ديكور أنيق ولذيذ لحفلات الزفاف والحفلات والمزيد لها شكل قفص جميل وتضع بداخله أي شيء مثل الزهور مصنوع من مكواة عالية الجودة مع طبقة طلاء تمنعه ​​من الصدأ بمرور الوقت يحتوي على خطاف أعلى القفص يمكنك استخدامه لتعليقه على شيء ما بسهولة', 'This Ornamental Bird Cage is a classy and dainty decor for weddings, parties, and more It has the shape of a beautiful cage and you put anything inside it such as flowers Made of high-quality iron with a coating of paint to prevent it from rusting with time It has a hook on the top of the cage which you can use to hang it on something easily', '1648755938767WhatsApp Image 2022-03-27 at 16.42.14.jpeg', 15, 129, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2652, 148),
(2657, 'حامل شموع بتزيينات ميتاليك 28100458', '28100458 Decorative Candle Holder with Metallic Accents', '250', NULL, NULL, 'قومي بتعزيز جاذبية غرفة معيشتك باقتناء حامل الشموع الأنيق هذا الذي يتميز بلمسات معدنية جذابة على شكل زهور. فهو خيار رائع للإهداء بفضل شكله المناسب وحجمه.', 'Heighten the appeal of your living space by getting this elegant candle holder that features attractive metallic accents showcasing flowers. The apt shape and size of the candle holder make it a great gifting option as well.', '1648756118862WhatsApp Image 2022-03-27 at 16.42.15.jpeg', 15, 129, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2653, 148),
(2658, 'تحفة مع انارة WAM', 'A masterpiece with  lighting WAM', '250', NULL, NULL, '', '', '1648756330315WhatsApp Image 2022-03-27 at 16.42.15 (1).jpeg', 15, 129, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2654, 148),
(2659, 'رف تخزين بمرآة  Mirrored 3-Tier Storage Rack', 'Mirrored  Storage Rack Mirrored 3-Tier Storage Rack', '85', NULL, NULL, 'إضافة مميزة إلى ديكورات منزلكِ، رف تخزين مصمم بمرآة وثلاثة مستويات، يتسم بالمتانة ويلائم الديكورات العصرية، ومصنوع من خامة عالية الجودة لضمان الاستدامة.', 'Select this elegant-looking storage rack to display your precious decor items neatly. The mirrored three-tier oval-shaped shelves and contrast metal frame together offer an exquisite appeal to this piece. It is durable and sturdy to use. Furthermore, this rack is convenient to maintain and clean regularly.', '1648756402961WhatsApp Image 2022-03-27 at 16.42.16.jpeg', 15, 129, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2655, 148),
(2660, 'تحفة ، زجاج  306440', 'Masterpiece, glass 306440', '110', NULL, NULL, 'اعتمدي هذه القطعة الرائعة لتعززي من أناقة ديكورات منزلكِ، تتميز بتصميم فريد وطابع عصري، ومصنوعة من خامة عالية الجودة لضمان الاستدامة والمتانة.', 'Adopt this wonderful piece to enhance the elegance of your home décor, it has a unique design and a modern feel, and it is made of high quality material to ensure sustainability and durability.', '1648756562247WhatsApp Image 2022-03-27 at 16.42.16 (1).jpeg', 15, 129, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2656, 148);
