(2839, 'سماعة ايفون أصلي فيتنامي', 'iPhone headphone original', '85', NULL, NULL, 'على عكس سماعات الأذن التقليدية الدائرية، صُممت ايربودز لتناسب تفاصيل بنية الأذن، ما يجعلها مريحة للكثيرين مقارنة بسماعات الأذن الأخرى. صُممت مكبرات الصوت داخل ايربودز لتعمل على زيادة إخراج الصوت وتقليل فقدانه، وهو ما يمنحك صوت عالي الجودة', 'Unlike traditional circular earbuds, AirPods are designed to fit the specifics of the ear structure, making them more comfortable for many compared to other earbuds. The speakers inside the AirPods are designed to maximize audio output and reduce audio loss, giving you high-quality sound.', '1649161939008WhatsApp Image 2022-04-04 at 15.22.45.jpeg', 2, 165, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2835, 184),
