(2844, 'كفر حماية  ماج سيف أيفون  - شفاف', 'MagSafe iPhone case - transparent', '70', NULL, NULL, 'مصنوعة من مزيج من البولي كربونات الشفاف بصريًا والمواد المرنة ، وتتناسب العلبة مع الأزرار لسهولة الاستخدام. تم تطبيق طلاء مقاوم للخدش على السطح الداخلي والخارجي. وتم تحسين جميع المواد والطلاء لمنع الاصفرار بمرور الوقت.  بفضل المغناطيسات المدمجة التي تتوافق تمامًا مع iPhone  ، توفر هذه الحقيبة تجربة إرفاق سحرية وشحن لاسلكي أسرع في كل مرة. عندما يحين وقت الشحن ، اترك الجراب على جهاز iPhone الخاص بك واضغط على شاحن', 'Made of a combination of optically transparent polycarbonate and flexible materials, the case fits within the buttons for ease of use. A scratch-resistant coating has been applied to the inner and outer surface. All materials and coatings have been improved to prevent yellowing over time.  With built-in magnets that perfectly match with the iPhone, this case provides a magical attaching experience and faster wireless charging every time. When its time to charge, leave the case on your iPhone an', '1649163509390WhatsApp Image 2022-04-04 at 15.22.55.jpeg', 2, 165, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:36:42', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2840, 184),
(2845, 'كفر حماية تيك 21 ايفو كلير - شفاف', 'Protective Cover Tech21 Evo Clear - Transparent', '65', NULL, NULL, 'يوفر Tech21 EvoClear لأجهزة iPhone حماية فعالة ضد الصدمات والخدوش الأخرى مع وضوح وضوح الشمس في الشفافية. له خصائص مثل الحماية من الميكروبات التي تقلل البكتيريا بنسبة تصل إلى 99.99٪ في غضون 24 ساعة ، ومادة مقاومة للأشعة فوق البنفسجية تقلل من خطر الاصفرار.', 'Tech21 EvoClear for iPhone provides effective protection against bumps and other scratches while being crystal clear in transparency. It has properties such as antimicrobial protection that reduces bacteria by up to 99.99% within 24 hours, and a UV-resistant material that reduces the risk of yellowing.', '1649163727006WhatsApp Image 2022-04-04 at 15.22.56.jpeg', 2, 165, '', '', '', '0', '0', '1', 'TRUE', '0', '2022-04-09 21:37:14', '2022-04-23 20:52:26', NULL, NULL, NULL, NULL, 2841, 184),
